INSERT INTO `descriptions` VALUES (5,30,'<h3>Laptop APPLE MacBook Pro 2021 16 &quot; MK183SA / A owns powerful performance with M1 Pro chip along with Ram and hard drive with large capacity. Combined with a luxurious and trendy design, this will be the laptop that gives you the best learning and working experience.</h3>\r\n\r\n<p>&nbsp;</p>','<p><strong>Stylish chic look, sharp images with vibrant colors</strong></p>\r\n\r\n<p>MacBook Pro 2021 is covered with monolithic metal with extremely delicate square beveled cuts and silver coating to create luxury and fashion for the laptop.&nbsp;With a weight of 2.1kg and dimensions of 35.57 x 24.81 x 1.68 cm, you can still fit it into a backpack or bag when traveling as well as easily hold it in your hand without causing it to be bulky.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 16 &quot;Mk183SA/A | Stylish luxury look\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/1/20220701_3601f31c-6045-4503-afe0-87f1a00ab742.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>This is the MacBook with the best ultra-thin bezel screen with 16-inch size and Liquid Retina XDR display resolution and high dynamic color range for the ability to display up to 1 billion colors.&nbsp;Keep the displayed image sharp with vibrant, vibrant colors.&nbsp;With a 120Hz refresh rate, everything from surfing the web to playing games is super smooth and responsive.</p>\r\n\r\n<p>Moreover, bring you HD quality calls with webcam.&nbsp;Make online calls when studying and working or Facetime with friends and relatives easier.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 16&quot; MK183SA/A | Sharp images\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/1/20220701_4416559b-f136-4eef-b3ba-1b42c8abbfcc.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p><strong>Conquer any task with exceptional performance, 16GB Ram and 512GB SSD storage</strong></p>\r\n\r\n<p>Apple did not hesitate to equip the Apple M1 Pro chip into the MacBook Pro 2021 MK183SA/A, providing outstanding performance with 10 cores including 8 high-performance cores and 2 power-saving cores.&nbsp;Helping you easily handle tasks from basic to complex in the smoothest and most gentle way.</p>\r\n\r\n<p>Comes with an integrated graphics card with up to 16 GPU cores to enhance outstanding graphics performance.&nbsp;Allows professional image processing to help you unleash your creativity and image editing, content such as video rendering or 3D rendering, faster 4K video rendering speed on photo editing and design software professional.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 16 &quot;Mk183SA/A | Conquer any task\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/1/20220701_8f81dc13-5f77-4644-9885-1fa904efcdae.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>With 16GB of RAM memory, Apple equips the Macbook for smooth multitasking.&nbsp;You can open multiple web windows, applications or software at the same time, and switch back and forth smoothly without any freezes or jerks.</p>\r\n\r\n<p>With internal memory of 512GB standard SSD is equipped with this high-end laptop, giving you a large space for you to comfortably store personal data such as photos or videos, files to support work and study. practice.&nbsp;At the same time, it allows you to start your device or open applications with extremely fast response times.</p>\r\n\r\n<p><img alt=\"Notebook / Laptop MacBook Pro 2021 16&quot; MK183SA/A | Large storage capacity\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/1/20220701_6fa919f2-c521-4d96-b638-da7564d2ea5c.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p><strong>Fast typing experience with high accuracy, fingerprint security</strong></p>\r\n\r\n<p>The Magic Keyboard of the MacBook Pro 2021 is equipped with a new row of function keys for Siri, Spotlight, Siri, Do Not Disturb and Dictation.&nbsp;Along with that is a keyboard with good bounce with reasonable key travel giving you a fast, flexible typing experience with high accuracy.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 16 &quot;Mk183SA/A | Fast typing\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/1/20220701_446d8e18-ad37-4cc8-8441-bd04c90f0a48.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Extremely high security with Touch ID helps you unlock or access applications that use security features quickly with just one light touch.&nbsp;What&#39;s more, Touch ID has a new tactile ring that guides you on how to position your finger correctly to unlock quickly and securely.&nbsp;Macbook Pro also uses MacOS operating system.</p>\r\n\r\n<p><strong>Common communication ports, impressive battery life of 100Wh</strong></p>\r\n\r\n<p>Apple has fully equipped the interface to its high-end Macbook to make connecting the laptop to different peripherals easier and more convenient.&nbsp;Includes 1 HDMI output port and 3 Thunderbolt 4 ports.</p>\r\n\r\n<p>Along with Wi-Fi 802.11ax standard Wifi 6 and Bluetooth 5.0 help you work, study and play seamlessly.&nbsp;For the ability to access the internet with high and fast speed with a stable connection line.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 16&quot; MK183SA/A | Common connection ports\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/1/20220701_7d8a19a2-8c4c-4920-b465-222a97b5fd17.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>With a 100Wh battery, Apple equips Macbook Pro 2021 for up to 21 hours of video playback and up to 14 hours of wireless web browsing.&nbsp;Besides, the laptop will be fully charged in only about 2 hours with fast charging technology with MagSafe charging port.</p>',2.100,'35.57 x 24.81 x 1.68','1080P FULL HD','macOS',100,12,'2023-03-03 04:37:14','2023-03-20 08:36:49'),(6,31,'<h2>Laptop MacBook Air 2020 13.3&quot; MGND3SA/A is a high-end model because it is equipped with Apple M1 processor, combined with 256GB SSD hard drive to handle tasks quickly. convenient and suitable for those who are studying or working, especially at work.</h2>','<h3><strong>Exquisite and luxurious design, optimal anti-glare screen thanks to IPS panels&nbsp;</strong></h3>\r\n\r\n<p>Attracting the eye thanks to its delicate design, combined with the yellow tone, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop also stands out thanks to the shiny metal-plated Apple logo placed in the middle of the machine.&nbsp;</p>\r\n\r\n<p>At the same time, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop has a compact size, only&nbsp;<strong>21.24 x 30.41 x 1.61cm</strong>&nbsp;and weighs only about&nbsp;<strong>1.3kg</strong>&nbsp;, making it easy to take to work or study anywhere.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGND3SA/A | Light and elegant design\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/Laptop-MacBook-Air-2020-13.3-MGND3SAA-vang-1.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop owns a 13.3-inch wide screen with a resolution of up to 2560 x 1600 pixels, incorporating True Tone technology to automatically adjust colors, giving you a visual experience. more realistic and natural images.</p>\r\n\r\n<p>The unique feature of the MacBook Air 2020 13.3&quot; MGND3SA/A laptop is the thin screen border design, which increases the image display area, giving you a wide viewing angle experience when working, playing games or watching. movie.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGND3SA/A | IPS anti-glare\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/Laptop-MacBook-Air-2020-13.3-MGND3SAA-vang-2.jpg\" style=\"height:auto\" /></p>\r\n\r\n<h3><strong>Top notch Apple M1 processor, 8GB RAM provides smooth multitasking</strong></h3>\r\n\r\n<p>Equipped with Apple M1 processor, MacBook Air 2020 13.3&quot; MGND3SA/A laptop can use office applications, entertainment, graphics software, vlog editing, image and video editing smoothly. without worrying about interruptions.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGND3SA/A | Apple M1 processor\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/Laptop-MacBook-Air-2020-13.3-MGND3SAA-vang-3.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Combined with 8GB LPDDR4 RAM with 3733MHz processing speed, it increases the ability to perform multitasking tasks smoother on the MacBook Air 2020 13.3&quot; MGND3SA/A laptop.</p>\r\n\r\n<h3><strong>256GB SSD hard drive provides comfortable storage space, quite durable battery life&nbsp;</strong></h3>\r\n\r\n<p>The MacBook Air 2020 13.3&quot; MGND3SA/A laptop is equipped with a 256GB SSD hard drive that helps the machine to quickly process tasks and provide a more comfortable storage space for users.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGND3SA/A | 256GB hard drive\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/Laptop-MacBook-Air-2020-13.3-MGND3SAA-vang-4.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, with the quite long battery life of the MacBook Air 2020 13.3&quot; MGND3SA/A laptop, you can use the device continuously without worrying about being interrupted by the battery running out, limiting charging repeatedly causing bottles. the battery.</p>\r\n\r\n<h3><strong>A variety of convenient connection ports, the keyboard is very responsive and extremely smooth to use</strong></h3>\r\n\r\n<p>Equipped with two Thunderbolt 3 ports that combine bandwidth with high speed, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop can transfer data, compatible with a variety of cables and adapters. Wireless connectivity includes: WiFi 802.11ax (Wifi 6) and Bluetooth 5.0.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGND3SA/A | Multiple connection ports\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/Laptop-MacBook-Air-2020-13.3-MGND3SAA-vang-5.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the&nbsp;<a href=\"https://phongvu.vn/c/macbook-air\">MacBook Air</a>&nbsp;2020 13.3&quot; MGND3SA/A laptop is equipped with an extremely responsive keyboard, fast speed and good response, and is also equipped with an LED light system so you can work efficiently. better in low light.</p>\r\n\r\n<p>Moreover, due to its large and responsive touchpad, along with an impressive response speed, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop allows you to comfortably operate anywhere on the touchpad. response.</p>\r\n\r\n<h3><strong>Superior fingerprint security system, macOS operating system to support learning and entertainment</strong></h3>\r\n\r\n<p>The super-advanced Touch ID fingerprint sensor technology has helped the MacBook Air 2020 13.3&quot; MGND3SA/A laptop to better secure your information and data, and help open the machine quickly.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGND3SA/A | MacOS\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/Laptop-MacBook-Air-2020-13.3-MGND3SAA-vang-6.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Not only that, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop is also supported to install macOS operating system with a large application store, helping you in the learning and entertainment process, meeting all your needs well. set.</p>',1.300,'30.41 x 21.24 x 0.41','HD','macOS',10000,12,'2023-03-03 07:40:32','2023-03-20 08:36:14'),(7,32,'<h2>Laptop MacBook Pro 2021 16 &quot; MK1E3SA / A breaks the limit with outstanding power from Apple&#39;s proprietary M1 chip. With exquisite luxury beauty and powerful configuration, the new generation Macbook Pro version 2021 promises to bring iFan impressive new experiences.</h2>','<p><strong>14-inch Retina XDR display with flat back design</strong></p>\r\n\r\n<p>Macbook Pro 2021 (MKGR3SA/A) has a 14-inch screen, size 31.26 x 22.12 x 1.55 cm and weighs only 1.6kg, this computer uses advanced Liquid Retina XDR screen technology.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 14 &quot;MkGR3SA/A | Flat and compact back design\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/4/20220704_d672acd6-f928-4b9c-a6d8-559b032e6bd6.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the best panel with a resolution of up to 3,024 x 1,964 pixels and ProMotion 120Hz technology has a brightness of up to 1600 nits, a contrast of up to 1,000,000:1 and support for up to 1 billion colors, through That makes your graphic design or entertainment work better.&nbsp;</p>\r\n\r\n<p><strong>Apple M1 Pro processor for the most powerful performance</strong></p>\r\n\r\n<p>The new Apple MacBook Pro is equipped with a processor chip: The Apple M1 Pro is an upgrade of the Apple M1 that was released last year.&nbsp;According to the manufacturer, this new generation of processor chip will be twice as powerful as the most powerful Intel Core i9 processor today.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 14&quot; MKGR3SA/A | Powerful Performance\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/4/20220704_7ab52eba-3fb4-43b4-bcbb-cb62d86647a9.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>This &zwnj;M1&zwnj; Pro processor has a 10-core CPU, a 16-core GPU.&nbsp;Media Engine is capable of performing better by equipped with 16GB RAM.&nbsp;Meanwhile, the &zwnj;M1&zwnj; Max chip has the same 10-core CPU as the &zwnj;M1&zwnj; Pro but is upgraded to a 32-core GPU.&nbsp;</p>\r\n\r\n<p>In addition, this laptop has the ability to store 512GB SSD, allowing users to comfortably store all documents, images, videos, etc. easily and quickly for work and study as well as own entertainment.</p>\r\n\r\n<p><strong>Equipped with a 70 Wh battery for about 17 hours of continuous play time</strong></p>\r\n\r\n<p>The MacBook Pro 14-inch 2021 is equipped with a 70Wh battery.&nbsp;The 14-inch MacBook will give you 17 hours of continuous video playback.&nbsp;The device will come with a USB-C to MagSafe 3 charging cord (2 meters) and a 67W charger (14-inch &ndash; M1 Pro 8-core CPU) very convenient for users.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 14&quot; MKGR3SA/A | Equipped with a 70Wh battery\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/4/20220704_0cd36773-b89e-49f6-a3fc-ac89a1a4777a.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>With such a long battery life, Macbook 2021 is suitable for those who move a lot without worrying about having to charge the device many times.&nbsp;Besides, the compact design is also an advantage for carrying the device anywhere, anytime.</p>\r\n\r\n<p><strong>New design with more ports</strong></p>\r\n\r\n<p>This new luxury silver version of Macbook Pro is equipped with 2 USB-C Thunderbolt 4 ports and a 3.5mm headphone jack.&nbsp;Besides, the MagSafe 3 charging port on the left and right edge will be where the HDMI port is located.&nbsp;There&#39;s also an SD card slot and a USB-C Thunderbolt 4 port.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 14&quot; MKGR3SA/A | New design with more connection ports\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/4/20220704_ab60776d-b0a2-4e1f-8afe-07b602f96dd9.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p><strong>Featured with the first &quot;rabbit ears&quot; image on a laptop</strong></p>\r\n\r\n<p>The latest version of MacBook Pro 2021 brings a &quot;rabbit ears&quot; design.&nbsp;In addition, the device has a 1080p webcam but does not integrate Face ID for users.&nbsp;You can video chat with relatives, friends...comfortably with sharper and more realistic images.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 14&quot; MKGR3SA/A | Featured with notch shape\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/4/20220704_6ee5f8bc-e5c9-46d7-9c3a-76b7e30e5c2e.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Macbook Pro MKGR3SA/A is equipped with a microphone that reduces environmental noise by 60% for the clearest voice.&nbsp;In addition, Apple Spatial Audio technology provides surround sound emulation.&nbsp;Capable of processing 5.1, 7.1 or Dolby Atmos signals directly through separate filters.&nbsp;To create a realistic 3D space.</p>\r\n\r\n<p><strong>Magic Keyboard for smooth typing experience</strong></p>\r\n\r\n<p>MacBook Pro 2021 sees the disappearance of the Touch Bar OLED screen.&nbsp;Use Magic Keyboard instead to give users a fast and smooth typing experience.&nbsp;The force-sensitive TouchPad will remain the same with its large size.</p>\r\n\r\n<p><img alt=\"Laptop / Laptop MacBook Pro 2021 14&quot; MKGR3SA/A | Smooth typing experience\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/4/20220704_cf63b760-8743-4799-8dc4-6d3244399ea2.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Wireless connection WiFi802.11ax (Wifi 6) and Bluetooth 5.0 for stable and fast connection.&nbsp;And the machine uses Apple&#39;s signature macOS operating system.</p>',2.100,'35.5 x 12.5 x 9.6','HD','macOS',100,12,'2023-03-03 14:04:41','2023-03-20 08:35:45'),(9,34,'<h2>The product lines of the Apple brand are always appreciated for quality as well as in shape and design. If you are in need of a thin, light, compact laptop for easy carrying, choosing the Apple MacBook Air 2020 MGN63SA/A Laptop is extremely reasonable.</h2>','<h3><strong>Stylish gray aluminum case.&nbsp;Minimalist, sophisticated design&nbsp;</strong></h3>\r\n\r\n<p>The Apple&nbsp;<a href=\"https://phongvu.vn/c/macbook-air\">MacBook Air</a>&nbsp;2020 MGN63SA/A laptop has a manufacturer-recommended case made from 100% recycled aluminum that contributes to environmental protection and provides high durability for this laptop.&nbsp;Because this is a good impact resistant material, it is able to protect the machine&#39;s components in the event of a strong impact.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGN63SA/A| Minimalist, sophisticated design\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/12/17/20211217_6e52a716-5eae-4dac-a786-1020bc45dedd.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>The MacBook Air 2020 MGN63SA/A has a size of 30.41 x 21.24 x 0.41&ndash;1.61 cm, which brings the advantage of a compact appearance to this computer compared to other products in the same segment.&nbsp;The device weighs only about 1.3kg, allowing users to comfortably carry it with them all day long without any inconvenience.</p>\r\n\r\n<h3><strong>High-resolution 13.3-inch widescreen display for vivid picture quality</strong></h3>\r\n\r\n<p><a href=\"https://phongvu.vn/c/macbook\">Apple MacBook</a>&nbsp;Air 2020 MGN63SA/A laptop&nbsp;is equipped with a 13.3-inch wide screen with a resolution of up to 2560 x 1600 pixels for sharp display image quality, vivid and true colors.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGN63SA/A| High resolution\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/12/17/20211217_7e50e712-a8c8-455e-92eb-2c2a48ae5485.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the screen of this computer also uses a non-touch IPS panel.&nbsp;As a result, this screen has a relatively wide viewing angle, viewers can comfortably look at any angle and can see the image displayed on it.</p>\r\n\r\n<h3><strong>Configuration has improved compared to the previous generation with Apple M1 processor, 8GB RAM, 256GB SSD hard drive</strong></h3>\r\n\r\n<p>APPLE MacBook Air 2020 MGN63SA/A is integrated with Apple M1 processor with improved manufacturing technology, this CPU delivers up to 3.5 times faster processing performance than the previous generation of Apple CPUs. .&nbsp;It can handle 3D graphics tasks with very modest power consumption.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGN63SA/A| Apple M1 . processor\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/12/17/20211217_8f633c9a-7b2e-446b-a1e1-19ef192a9dfe.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Using 8GB Onboard LPDDR4 3733MHz internal memory and a 256GB SSD hard drive not only provides a relatively spacious storage space for users but also increases the processing power of this computer.&nbsp;It can handle multi-tasking tasks smoothly and quickly, and the processing speed of computer operations is extremely fast such as opening and closing tabs, starting the computer, ....</p>\r\n\r\n<h3><strong>Magic Keyboard keyboard provides impressive typing experience</strong></h3>\r\n\r\n<p>The Apple MacBook Air 2020 MGN63SA/A laptop uses a keyboard specifically designed for Apple product lines: Magic Keyboard.&nbsp;The keystroke is only 1mm, the bounce is good and smooth, providing an impressive typing experience for users of this laptop.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGN63SA/A|Madic Keyboard\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/12/17/20211217_b56efe97-904c-474a-acb9-c8b16d29b0be.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>The keyboard is also equipped with LED lights to help users use it in low light conditions, which is very convenient.&nbsp;</p>\r\n\r\n<h3><strong>Connect quickly with Thunderbolt 3 and other wireless technologies</strong></h3>\r\n\r\n<p>With data transfer power 2 times faster than the previous generation, 2 Thunderbolt 3 ports provide fast, convenient connectivity for MacBook Air 2020 MGN63SA/A with other electronic peripherals. .&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGN63SA/A| Quick connection\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/12/17/20211217_84ddab67-ce46-44fb-a653-28343000c219.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, users can also quickly connect it to other wireless devices for data transmission by WiFi 802.11ax and Bluetooth 5.0 technology.&nbsp;These are all the latest generation standard wireless connection technologies integrated on this high-end laptop.&nbsp;Faster, smoother transmission speeds bring great user experiences</p>\r\n\r\n<h3><strong>Exclusive macOS operating system on Apple products</strong></h3>\r\n\r\n<p><img alt=\"Laptop MacBook Air 2020 13.3&quot; MGN63SA/A|| macOS operating system\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/12/17/20211217_d3c99f4e-77eb-4981-bf91-61d98c821bab.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>APPLE MacBook Air 2020 MGN63SA/A uses macOS operating system with many new interface improvements, the operations on the machine become smoother and more smooth to bring maximum convenience to the user. use.&nbsp;In particular, to mention the application store with a lot of choices for users from this operating system.</p>',1.300,'30.41 x 21.24 x 0.41','HD','macOS',10000,12,'2023-03-09 03:41:39','2023-03-20 08:33:59'),(10,35,'<h2>Apple MacBook Pro 2020 MYDA2SA/A laptop with a luxurious and classy look, combines a modern Apple M1 processor, in addition to having 8GB LPDDR4 RAM to help you smoothly perform multitasking tasks. This is a Macbook product in the high-end segment that is suitable for business people with high work intensity.</h2>','<h3><strong>Luxurious and classy design, owns a 13.3-inch wide screen with extremely high resolution</strong></h3>\r\n\r\n<p>The Apple MacBook Pro 2020 MYDA2SA/A laptop has a luxurious and classy appearance, extremely thin and light in size, weighing only 1.4 kg and only 21.24 x 30.41 x 1.56 cm, so you can easily take it anywhere to do it. work and study, this is quite useful for those who go to meet and discuss contracts with business partners.</p>\r\n\r\n<p><img alt=\"Laptop APPLE MacBook Pro 2020 MYDA2SA/A |  Luxurious design\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/5/6/20220506_d10226d5-eb89-4049-bf66-75bc1912ad5b.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the 