e layout that is easy to use, the keys have a good, smooth bounce for high accuracy.&nbsp;Keyboard LEDs&nbsp;<strong>are</strong>&nbsp;equipped for easy operation even in dimly lit environments.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEJ3SA/A |  Keyboard\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/27/20220927_b4c0889b-8abc-4aec-acc9-03be32df80c7.png\" style=\"height:auto\" /></p>\r\n\r\n<p>The MacBook Pro M2 is designed with&nbsp;a smooth, precise&nbsp;<strong>Touch Bar that&#39;s easy to use.&nbsp;</strong>The integrated&nbsp;<strong>Touch ID</strong>&nbsp;fingerprint sensor makes your information and data better secure, in addition, you just need to use your fingerprint to unlock your MacBook easily.</p>\r\n\r\n<h3>Impressive battery life, modern macOS</h3>\r\n\r\n<p>MacBook Pro M2 uses a&nbsp;<strong>built-in battery</strong>&nbsp;with a long-lasting battery life that is long enough for you to comfortably work or study.&nbsp;In addition, the active cooling system helps the laptop maintain its performance during operation and effectively saves battery.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEJ3SA/A |  Operating system\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/27/20220927_7e5b0bb3-9a1b-439c-ac3d-5486fbd51e35.png\" style=\"height:auto\" /></p>\r\n\r\n<p><strong>The pre-installed MacOS&nbsp;</strong>&nbsp;operating system&nbsp;on MacBook gives you a modern workspace with many utilities, meeting the needs of work, study as well as entertainment, in addition to helping users save money. installation cost.</p>\r\n\r\n<h3>Modern audio technology, equipped with a variety of connection ports</h3>\r\n\r\n<p>MacBook Pro M2 gives you an immersive, authentic sound experience thanks to its dual speaker system and&nbsp;advanced&nbsp;<strong>Dolby Atmos technology.&nbsp;</strong>In addition, the device also has up to&nbsp;<strong>3 microphones</strong>&nbsp;that receive clear sound to help you communicate stably and easily.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEJ3SA/A |  Sound\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/27/20220927_69aea875-6d73-4601-99c7-07b420980171.png\" style=\"height:auto\" /></p>\r\n\r\n<p>MacBook Pro M2 is integrated with 2&nbsp;convenient&nbsp;<strong>Thunderbolt ports that provide high-speed bandwidth, easy and flexible connection to many peripheral devices.&nbsp;</strong><strong>In addition, MacBook also has Wi-Fi 802.11ax (Wifi 6)</strong>&nbsp;wireless connectivity standards&nbsp;for stable internet connectivity,&nbsp;<strong>Bluetooth 5.0</strong>&nbsp;for fast and easy data transmission.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEJ3SA/A |  Connector\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/27/20220927_7a6e3bf4-f24b-47d5-89e3-4a7c5966785d.png\" style=\"height:auto\" /></p>\r\n\r\n<p>&nbsp;</p>',1.400,'30.41 x 21.24 x 1.56','HD','macOS',NULL,12,'2023-03-09 06:43:56','2023-03-20 08:43:59'),(19,44,'<h3><strong>The MSI Modern 15 A11M-1024VN laptop</strong>&nbsp;possesses powerful performance from the 11th generation Core 5 processor. With its high-end finish and modern compact design, MSI promises to be the reliable choice with investment to accompany you in daily work and study.&nbsp;</h3>\r\n\r\n<p><strong>Classy gray design, compact and easy to carry</strong></p>\r\n\r\n<p>The outer shell of the MSI Modern 15 A11M-1024VN laptop is designed from monolithic materials with a modern gray color to suit all your workspaces.&nbsp;At the same time, this MSI laptop is also firmly protected by a sturdy outer shell that limits external impacts such as strong collisions, scratches, ...</p>','<p><strong>Classy gray design, compact and easy to carry</strong></p>\r\n\r\n<p>The outer shell of the MSI Modern 15 A11M-1024VN laptop is designed from monolithic materials with a modern gray color to suit all your workspaces.&nbsp;At the same time, this MSI laptop is also firmly protected by a sturdy outer shell that limits external impacts such as strong collisions, scratches, ...</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_f64dc95a-2b16-4c4f-be34-53ac84f04bd6.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>MSI Modern 15 A11M-1024VN possesses a compact and lightweight monolithic design with dimensions of 35.68 x 23.375 x 1.69 cm and a weight of 1.6kg, ready for you to take anywhere.&nbsp;Besides, this laptop also has a luxurious and elegant appearance.&nbsp;</p>\r\n\r\n<p><strong>15.6-inch Full HD screen sharp, thin border creates wide angle&nbsp;</strong></p>\r\n\r\n<p>The MSI Modern 15 A11M-1024VN laptop with a standard 15.6-inch screen supports good display of many software at the same time.&nbsp;This MSI laptop also has a high resolution of 1920 x 1080px Full HD and a non-touch IPS panel that delivers extremely sharp image quality.&nbsp;Equipped with HD webcam will help you video call or join online meetings easily.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_a65cba55-18bf-4e2b-b6fb-218df33c5fe2.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Thin bezels make the design more beautiful for this MSI Modern 15 A11M-1024VN laptop and increase the wide viewing angle when used.&nbsp;The screen is balanced in size and the thin bezels will pull your viewing angle more multi-dimensional for a more perfect workspace.</p>\r\n\r\n<p><strong>Unexpectedly strong performance with Intel Core i5-1155G7 chip and 8Gb Ram</strong></p>\r\n\r\n<p>The MSI Modern 15 A11M-1024VN laptop offers a powerful configuration with Intel Core i5-1155G7 processor for clock speeds from 2.5GHz - 4.5GHz, with 8MB cache and 4 cores, 8 threads to help handle the processing. Manage tasks quickly and efficiently.&nbsp;</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_d6047305-d95e-4e9b-80fb-aa8f1814d3d7.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>This laptop is equipped by MSI with DDR4 RAM with 8Gb capacity, making your system work more optimally thanks to DDR4 ram and 3200MHz Ram bus for good multitasking speed.&nbsp;In addition, the laptop also supports 2 ram slots for the ability to support you to expand memory and use multiple tabs and applications at the same time, so it is also quite responsive.</p>\r\n\r\n<p><strong>Sharp Intel Iris Xe Graphics chip, 512Gb hard drive</strong></p>\r\n\r\n<p>Intel Iris Xe Graphics chip is integrated to improve performance in the most optimal way to meet all users&#39; creative passions with exporting 4K images on application software such as Photoshop,... a Professionally with today&#39;s most popular games such as PUBG, LOL, ...&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop MSI Modern 15 A11M-1024VN |  Sharp graphics\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_4331e148-e617-4055-857a-a794a0c6d820.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>The 512Gb SSD M.2 NVMe hard drive provides huge storage capacity for you to be more comfortable when downloading your favorite software and games for entertainment.&nbsp;Standard SSD memory also stands out for its ability to speed up the boot-up process, supporting faster data access that takes only a few seconds.</p>\r\n\r\n<p><strong>3-cell battery used for a long time, LED keyboard full of number keys</strong></p>\r\n\r\n<p>For this MSI Modern 15 A11M-1024VN laptop, you own 3 cells of 52Wh, Instant battery for increased laptop use time compared to other low-value batteries and use from 5-9 hours depending on the battery life. to the nature of your work.&nbsp;A quick charge of just about 3 hours will get you back to work faster after each charge.</p>\r\n\r\n<p><img alt=\"Laptop MSI Modern 15 A11M-1024VN |  Long battery life led keyboard\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_d9fe9a0c-e511-42b3-bc38-b1b628089e97.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>The MSI Modern 15 A11M-1024VN laptop has a comfortable keyboard space with full number keys.&nbsp;The deep key travel helps you type quickly with a smooth and responsive feel.&nbsp;Beautiful LED light effects help you see more clearly in dark conditions and enhance the feeling every time you play games.</p>\r\n\r\n<p><strong>Pre-installed Windows 10 Home 64-bit, diverse connectivity ports</strong></p>\r\n\r\n<p>To help customers save installation costs, the company has equipped the MSI Modern 15 A11M-1024VN laptop with 64-bit Windows 10 Home operating system, you can use or upgrade limited high-end game software. Internet connection is interrupted or lagged.</p>\r\n\r\n<p><img alt=\"Laptop MSI Modern 15 A11M-1024VN |  Diverse connection ports\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_224761e0-a9eb-4e95-9cd3-948a9a665568.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>With a variety of modern connectivity ports mounted on the MSI Modern 15 A11M-1024VN laptop, including 1 HDMI port, 3 USB 3.2 ports, 1 Thunderbolt port, 1 micro SD card slot.&nbsp;Besides, the laptop also has good compatibility with wireless connections such as WiFi 802.11ax(Wifi 6), Bluetooth 5.1 for fast, smooth and stable wireless transmission speed over time.</p>',1.600,'35.68 x 23.375 x 1.69','yes','Win 11',52,12,'2023-03-09 06:49:24','2023-03-20 08:44:44'),(20,45,'<p><strong>INTRODUCTION AND REVIEW OF LAPTOP MSI MODERN 14</strong></p>\r\n\r\n<p>(depending on the version of each country and each region, there are changes in product features)</p>','<p>Updating...</p>',1.400,'31.99 x 22.3 x 1.935','yes','Win 11',39,12,'2023-03-09 07:05:25','2023-03-20 08:47:17'),(21,46,'<h2><strong>The MSI Creator M16 A12UC i7 laptop (292VN) owns the powerful, angular lines and outstanding performance of the 12th generation Intel chip &nbsp;, ready to take you into a new era of technological beauty, breaking all the worlds. limited to creative users.</strong></h2>\r\n\r\n<p>&nbsp;</p>','<p><strong>Impressive performance tackles any creative challenge</strong></p>\r\n\r\n<p>The MSI Creator laptop carries with it an advanced Intel Core i7 12700H CPU , more power efficient combined with an &nbsp;RTX 3050 4 GB graphics card. I tested the performance of the machine through Cinebench R23 software, the single-core and multi-core scores were 1792 and 14885 , respectively . With the measured results, I find the machine can run smoothly most of the professional editing applications, the highlight gives users a powerful configuration, serving the needs of a graphics laptop &nbsp;- technical .</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The device owns<strong> 16 GB RAM</strong> for the ability to run multiple applications smoothly. I have the experience of writing a thesis at the same time opening 20 Chrome tabs to search for information, listen to music, ... without jerks, freezes.</p>\r\n\r\n<p><strong>MSI Creator laptop</strong> owns a &nbsp;<strong>512 GB SSD</strong> hard drive for fast data access speed, I&#39;m impressed that it takes less than 10 seconds to boot up and open Photoshop. The storage space in my opinion is enough, but to expand the memory, it is recommended that you upgrade the SSD to have storage space for larger files.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>After doing my work, I played League of Legends to relax. The laptop runs well from 240 to 250 FPS at maximum graphics settings, stabilizing each frame without jerking, lag when launching. However, I think this is a machine that better meets work than gaming because the manufacturer has focused on creative users rather than entertainment needs.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The rendering ability of the machine is also impressive, equipped with <strong>&nbsp;Intel Core i7 12700H</strong> CPU combined with &nbsp;<strong>4 GB RTX 3050</strong> video card to bring outstanding power. I tried rendering a short video of about 5 minutes , the machine runs smoothly and stably without any freeze or sudden heat.</p>\r\n\r\n<p><strong>Display space unlocks limitless imagination</strong></p>\r\n\r\n<p>The MSI laptop is equipped with a <strong>16-inch screen with QHD+ (2560 x 1600)</strong> resolution , 500 nits brightness that provides sharp image quality, helping you monitor clear images even when sitting in a place with high intensity. strong light, open space,...</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>IPS technology for wide viewing angles up to 178 degrees . When experiencing YouTube with friends, sitting in different positions, but the screen still displays vivid colors, clear image quality in every viewing position.</p>\r\n\r\n<p>I have checked the screen quality through Spyder 5 Pro software , the results are impressive with 100% sRGB , 90% Adobe RGB , 100% DCI-P3 . With the measured data, I am sure this is one of the machines with a screen that achieves true, accurate color on each frame, which the name &quot;Creator&quot; means creative users are very interested in.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The MSI True Color display feature allows you to change color modes according to individual needs such as: sRGB, Adobe RGB, DCI-P3,... in addition, it can also balance the colors to suit the job. daily work.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>Mysterious beauty and charm.</strong></p>\r\n\r\n<p>The minimalist design style but still exudes the elegance of this laptop in every space thanks to the durable metal shell covered with modern gray paint, giving a cool feeling when touching the surface of the machine. The weight of 2.26 kg &nbsp;will be a bit heavy for women, but in return, it also makes the machine very solid and durable.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>The 180-degree hinge</strong> makes it easy to share what&#39;s on the screen with everyone. Especially when I go to a group study, or when I sit at a coffee shop, I don&#39;t need to rotate the whole machine, but just need to open it 180 degrees so that the opposite person can monitor the content on the screen.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The air inlet slot is arranged by the MSI house on both sides to help the machine dissipate heat better, bringing coolness. I consider this factor very important when working for a long time, the palm rest does not heat up, does not cause discomfort when manipulating the surface of the machine.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>I have experienced text editing on Word, the deep key stroke helps me not to have difficulty when manipulating, the good bounce also helps me type correctly. In addition, MSI allows the keyboard backlight to also support 3 levels of brightness: low light, medium light, strong light, allowing you to choose the appropriate brightness intensity in each location like in your office using a medium level, or When I sit in a cafe during the day, I use high light.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>MSI laptop is equipped with a 53.5 Wh battery , but it is a high-performance laptop, so the power consumption will also be more, I encourage you to always plug in the charger to not interrupt your work and promote the maximum performance of the machine. .</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The device is also fully equipped with communication ports including: USB, HDMI, headphone jack, LAN, USB Type-C. Featured with a USB Type-C port that supports very fast connection and data retrieval.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>Built-in useful technology</strong></p>\r\n\r\n<p>The level of security is increased when the laptop is equipped with one-touch fingerprint security , saving me more time when logging in with just a touch without entering a password. The fingerprint sensor position is located to the left of the touchpad (touchpad) easy to remember and convenient when working on the machine.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>MSI Creator M16 A12UC i7 12700H (292VN)</strong> - Fingerprint Security Realtek High Definition Audio technology amplifies the sound quality when playing games, watching movies, listening to music, ... brings quality sound, without distortion, helping users have an immersive entertainment and relaxation space.</p>\r\n\r\n<p>&nbsp;</p>',2.300,'35.9 x 25.9 x 2.395','HD','Win 11 Home',53,12,'2023-03-09 07:34:07','2023-03-20 08:48:10'),(22,47,'<h2>Apple&#39;s products always attract users by luxury in design as well as top quality and the Macbook Pro line is not an exception. With an ultra-thin and light design and a compact 13-inch screen for flexible movement. This Apple laptop is sure to satisfy you from image to configuration.</h2>','<p><img alt=\"13-inch MacBook Pro Z16S00034\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_8f6f10e2-6d0d-4397-ab2e-91910e9422fc.png\" style=\"height:auto\" /></p>\r\n\r\n<h3>Compact, trendy design and high-quality metal shell material</h3>\r\n\r\n<p>The 13-inch MacBook&nbsp;<strong>&nbsp;</strong>possesses the typical design language of the Apple family, showing the fashion and sophistication to help increase the luxury for the owner, suitable for all users, especially business people.&nbsp;With its versatility, compact size with only&nbsp;<strong>30.41 x 21.24 x 1.56cm</strong>&nbsp;and a modest weight of only&nbsp;<strong>1.4kg</strong>&nbsp;, you can take this MacBook anywhere.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  Gray color\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_e7f800b0-4622-4b14-a803-5e25867265d8.png\" style=\"height:auto\" /></p>\r\n\r\n<p>Besides, every line of the MacBook is meticulously finished with perfectly rounded corners and a&nbsp;beautiful&nbsp;<strong>gray color .&nbsp;</strong>The entire frame and shell are made of&nbsp;<strong>high-quality metal</strong>&nbsp;that not only contributes to the elegance but also protects the MacBook from being dented when there is an unexpected impact.</p>\r\n\r\n<h3>Well configured with Apple M2 CPU, 16GB RAM&nbsp;</h3>\r\n\r\n<p><strong>Apple</strong>&nbsp;&#39;s laptop&nbsp;is equipped with the exclusive&nbsp;<strong>Apple M2</strong>&nbsp;chip to smoothly handle all daily tasks as well as work with graphics or edit videos.&nbsp;The chip has much better multi-threading performance than the Apple M1 chip when it comes to&nbsp;<strong>8 high-performance cores</strong>&nbsp;.&nbsp;This new generation Macbook Pro is chosen by many KOLs and tiktokers as a companion for their work.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  Chip M2\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_5e45fe6e-70b8-42f7-bfab-44d0a2b9cc02.png\" style=\"height:auto\" /></p>\r\n\r\n<p>Besides, the MacBook has a large&nbsp;<strong>RAM</strong>&nbsp;memory of up to&nbsp;<strong>16GB</strong>&nbsp;to help you comfortably use many applications as well as open many websites to serve the needs of work, study and entertainment smoothly. , no lag.&nbsp;</p>\r\n\r\n<h3>13.3 inch screen with Retina panel, support HD Webcam&nbsp;</h3>\r\n\r\n<p>The MacBook M2 laptop has a&nbsp;<strong>13.3-inch&nbsp;</strong>&nbsp;screen that is just enough for all your work and study experiences, and with this screen, the laptop looks significantly more compact.&nbsp;Besides, the&nbsp;<strong>Retina</strong>&nbsp;display is equipped with high-quality, sharp images that help every detail be displayed more clearly with a resolution of&nbsp;<strong>2560 x 1600 pixels</strong>&nbsp;.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  Screen\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_4b1252ce-a3ba-4626-ab66-118b5baa06e9.png\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the 13-inch MacBook Pro&nbsp;<strong>&nbsp;</strong>also supports&nbsp;<strong>HD Webcam</strong>&nbsp;with high and clear image quality when you work and study through many popular online applications such as Zoom, Google Meet or Zalo, Messenger.</p>\r\n\r\n<h3>512GB SSD Storage, LED Backlit Keyboard</h3>\r\n\r\n<p>Apple laptops have a large memory capacity of up to&nbsp;<strong>512GB&nbsp;</strong>&nbsp;, so you can comfortably store all necessary information, documents, files or download many applications to meet your work and study needs. your exercise, entertainment.&nbsp;<strong>Standard SSD</strong>&nbsp;memory&nbsp;helps MacBook boot up quickly within seconds to help you use it immediately without having to wait too long.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  Magic Keyboard\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_d4653436-dac2-4bd9-acef-b9beba70ef7b.png\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the MacBook keyboard is meticulously finished, perfect in design and experience with each key having a good bounce for a smooth typing feeling.&nbsp;The keyboard also supports monochrome&nbsp;<strong>LED lights</strong>&nbsp;to help you type more comfortably and easily in low-light or low-light environments.</p>\r\n\r\n<h3>Good battery life, useful Touch Bar</h3>\r\n\r\n<p><strong>MacBook Pro is equipped with a 58Wh&nbsp;</strong>&nbsp;battery&nbsp;that gives you a good experience in a meeting or study session when used with light tasks without worrying about running out of battery.&nbsp;In addition, the device is also equipped with a modern charging port that helps to charge the battery significantly faster.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  Modern Touch Bar\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_97a52d6e-8a5e-4f06-9661-44b0a1c08ef0.png\" style=\"height:auto\" /></p>\r\n\r\n<p>Another difference between the Pro line and the Air line is that the Pro line will be equipped with a modern and beautiful&nbsp;<strong>Touch Bar</strong>&nbsp;, bringing many unexpected utilities.&nbsp;Users can control by touch with good sensitivity to quickly manipulate tasks such as turning on / off the sound, transferring music or many other utilities.</p>\r\n\r\n<h3>Convenient Touch ID and Ambient Light sensor features</h3>\r\n\r\n<p>With unique&nbsp;<strong>Touch ID&nbsp;</strong>&nbsp;on all Apple products based on a fast one-touch sensor when secured by biometrics with&nbsp;highly accurate user&nbsp;<strong>fingerprint recognition&nbsp;</strong>&nbsp;to help you store all the important information be safer than ever.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  Fingerprint Unlock\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_a78478e6-2d74-4854-907d-dbff9b429fbd.png\" style=\"height:auto\" /></p>\r\n\r\n<p>In addition, the device also supports the&nbsp;<strong>Ambient Light sensor&nbsp;</strong>&nbsp;feature , which is a light sensor - a type of optical sensor.&nbsp;With an automatic mechanism that adjusts the light of the screen and keyboard to suit different types of environmental lighting conditions.</p>\r\n\r\n<h3>MacOS operating system, many convenient connections</h3>\r\n\r\n<p><strong>With the MacOS&nbsp;</strong>&nbsp;operating system&nbsp;equipped on&nbsp;<strong>&nbsp;</strong>MacBook Pro Z16S00034, it helps you have high security from virus intrusion, and also gives you many unique and new experiences with many utilities that you only have. can be seen when owned on an Apple laptop.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  MacOS\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_2e124b8e-46f2-49ec-8a31-bb777d07c8a4.png\" style=\"height:auto\" /></p>\r\n\r\n<p>Finally, MacBook is also equipped with 2&nbsp;<strong>Thunderbolt 3</strong>&nbsp;ports that allow the computer to quickly connect to many other devices at the same time with quality picture and sound.&nbsp;The device also supports&nbsp;<strong>WiFi 802.11ax (Wifi 6)</strong>&nbsp;with a stable network connection to give you a lag-free experience and&nbsp;<strong>Bluetooth 5.0</strong>&nbsp;capable of wireless data transmission with high compatibility with many devices in the world. wide scope.</p>\r\n\r\n<p><img alt=\"MacBook Pro 13 inch Z16S00034 |  Connector\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/7/20221007_05036d9c-de81-499b-af44-c40c34363329.png\" style=\"height:auto\" /></p>\r\n\r\n<h3>&nbsp;</h3>',1.400,'30.41 x 21.24 x 1.56','HD','macOS',58,12,'2023-03-09 07:50:55','2023-03-20 08:49:30'),(23,48,'<h2>APPLE Macbook&nbsp;Pro 2020 MYDC2SA / A&nbsp;is a&nbsp;laptop line from the world&#39;s leading technology brand, owning an advanced Apple M1 chip with impressive performance, 512GB SSD storage hard drive and 13.3 inches IPS screen, the product is a great choice for customers who prefer class.</h2>','<h3><strong>Apple M1 - the most powerful chip that Apple designed for the Macbook</strong></h3>\r\n\r\n<p>The Apple MacBook Pro 2020 MYDC2SA/A laptop owns the Apple M1 chip line - the most advanced and powerful chip generation that Apple has ever designed for the Macbook, bringing performance and performance many times higher than previous product lines.</p>\r\n\r\n<p>With Apple M1 chip, the device owns 8 CPU cores, including 4 high-performance cores and 4 power-saving cores.&nbsp;In case customers perform heavy tasks, the device will take full advantage of the high-performance cores, and vice versa, for simple operations, the device will automatically switch to using energy-saving cores.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Pro 2020 13.3&quot; MYDC2SA/A (M1/8GB/SSD512GB) (Silver) | Owns Apple M1 chip line\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/5/7/20210507_b990bba3-86c5-42ab-ac23-dbde6793d6f4.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>From that, it can be seen that the device is designed by Apple with the criterion of working efficiently on each watt of power, while providing strong performance to serve the needs of customers while extending the time of use, helping to save money. energy efficiency.</p>\r\n\r\n<p>In addition, the Apple M1 chip series also integrates an artificial intelligence processing core - Neural Engine, which helps software developed and supports machine learning to work more efficiently on devices, such as Final Cut Pro or Pixelmator Pro.</p>\r\n\r\n<h3><strong>Simple but luxurious design, ensuring high durability, compact size</strong></h3>\r\n\r\n<p><a href=\"https://phongvu.vn/macbook-1061.cat\">The Apple MacBook</a>&nbsp;Pro 2020 MYDC2SA/A laptop&nbsp;, like other Apple product lines, is famous for its sophisticated design.&nbsp;The whole body is covered with a luxurious silver color, the logo is sophisticatedly laser engraved and each line is carefully processed to every detail, giving it a classy and different look.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Pro 2020 13.3&quot; MYDC2SA/A (M1/8GB/SSD512GB) (Silver) | Simple luxury design\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/5/7/20210507_a730f8b1-cbd9-4d7d-b7fd-b7c814c0a529.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Apple is one of the leading brands in terms of product durability in the market.&nbsp;Therefore, customers do not need to worry about the shelf life of the product.&nbsp;At the same time, with its slim and light size, the device allows you to easily carry it with you wherever you go.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Pro 2020 13.3&quot; MYDC2SA/A (M1/8GB/SSD512GB) (Silver) | Durable design\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/5/7/20210507_f03fd31e-bea1-406f-aad9-df66ba9e7ce8.jpg\" style=\"height:auto\" /></p>\r\n\r\n<h3><strong>Ensure high security, integrate Touch ID on the power button</strong></h3>\r\n\r\n<p>The Apple MacBook Pro 2020 MYDC2SA/A laptop is designed with a focus on security features, making the boot process safe, optimally protecting stored information and personal data of customers, limiting access unauthorized access, stealing resources.</p>\r\n\r\n<p>In addition, the product is also integrated with Touch ID on the power button to increase security efficiency, maximum protection of user privacy, and the system also ensures not to grant access to your fingerprint for users. any access.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Pro 2020 13.3&quot; MYDC2SA/A (M1/8GB/SSD512GB) (Silver) | Advanced security\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/5/7/20210507_0b1f3a1e-761a-47ff-8e13-400c604f086b.jpg\" style=\"height:auto\" /></p>\r\n\r\n<h3><strong>8GB RAM Onboard LPDDR4 3733MHz, 512GB SSD storage</strong></h3>\r\n\r\n<p>Apple MacBook Pro 2020 MYDC2SA/A laptop owns 8GB RAM Onboard LPDDR4 3733MHz for high and smooth task processing speed, optimally supports multitasking, significantly increases device performance. , limit jerky, effective lag.</p>\r\n\r\n<p>In addition, the product also provides a hard drive with a large storage capacity of 512GB SSD for high read - write speed, stable operation, maintaining data even when the laptop is suddenly powered off, ensuring durability. help the laptop to operate smoothly, with less heat and significantly save power consumption.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Pro 2020 13.3&quot; MYDC2SA/A (M1/8GB/SSD512GB) (Silver) | Fast multitasking\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/5/7/20210507_d509db80-d0e9-4265-91c2-baaf0ced0988.jpg\" style=\"height:auto\" /></p>\r\n\r\n<h3><strong>Own proprietary operating system MacOS</strong></h3>\r\n\r\n<p>Laptop APPLE MacBook Pro 2020 MYDC2SA/A owns the exclusive MacOS operating system - famous for its stable and smooth operation, beautiful interface, and integrated with many features and applications only for the product. Apple products.</p>\r\n\r\n<p>Not only that, MacOS also brings the strength of graphics to the device, helping to maximize the work related to professional design, along with the ability to synchronize, allow the backup process, Data sharing just got easier between Apple devices.</p>\r\n\r\n<p><img alt=\"Laptop MacBook Pro 2020 13.3&quot; MYDC2SA/A (M1/8GB/SSD512GB) (Silver) | MacOS\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/5/7/20210507_7bf8ee02-b7d0-4df1-9e47-f2510963b91d.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>&nbsp;</p>',1.400,'21.24 x 30.41 x 1.56','HD','macOS',NULL,12,'2023-03-09 07:54:40','2023-03-20 08:50:20'),(24,49,'<h2><strong>Laptop MSI Delta 15 A5EFK - ELECTRICAL&nbsp;AWARENESS&nbsp;</strong></h2>','<p>Unexpected and unpredictable!&nbsp;Ultra-thin and ultra-light with high performance!&nbsp;That&#39;s right, the Delta 15, AMD Advantage &trade; Edition or the MSI Delta 15 A5EFK-095VN Laptop is not only equipped with the latest AMD Ryzen &trade; 9 5900HX Mobile Processor and AMD Radeon &trade; RX 6700M Mobile Graphics.&nbsp;It also has a special design with a weight of 1.9 kg and a thickness of 19mm.&nbsp;An amazingly thin and super light laptop, isn&#39;t it!&nbsp;Not only that, this MSI laptop is also added with advanced SmartShift technology, the latest smart access memory and the latest Wi-Fi 6E wireless access.</p>\r\n\r\n<p>That&#39;s why this year&#39;s MSI Delta 15 Laptop deserves to be one of the Gaming, Graphics Laptops that have all the advantages and powerful performance in a high-end design.&nbsp;It can be said that the MSI Delta 15 Gaming Laptop will lead the changes, break the framework and create a new transformation in the gaming world.</p>\r\n\r\n<h3><strong>A NEW WAY TO BE</strong></h3>\r\n\r\n<p><strong>(img)</strong></p>\r\n\r\n<p>Crafted in an all-aluminum body with a carbon gray metallic finish, the Delta 15 offers a new look and sleek look like never before in Notebook history.</p>\r\n\r\n<h3><strong>POWERED BY THE MOST ADVANCED TECHNOLOGY</strong></h3>\r\n\r\n<p>Built with the latest groundbreaking 7nm technology, the AMD Ryzen&trade; 9 5900HX Mobile Processor with AMD Radeon&trade; RX 6700M Mobile Graphics delivers desktop-class performance in a laptop body gaming to enjoy immersive gaming and multimedia experiences like never before.<br />\r\n*Note: MSI has tested the combination of AMD Ryzen&trade; 9 5900HX Mobile Processor with AMD Radeon&trade; RX 6700M Mobile Graphics and DDR4-3200 dual-channel memory to produce the above results.&nbsp;However, its performance may still vary depending on the configuration.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<h3><strong>AMD SMARTSHIFT TECHNOLOGY</strong></h3>\r\n\r\n<p>AMD SmartShift technology allows the system to automatically change the power supply to maximize or match performance whether you&#39;re gaming or creating content.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>AMD SMART ACCESS MEMORY TECHNOLOGY</strong></h3>\r\n\r\n<p>AMD Ryzen 5000 series mobile processors and AMD Radeon RX 6000M mobile graphics consistently achieve higher performance in some titles through new levels of data transfer to take gaming to a new level of realism with supporting features like DirectX 12 Ray Tracing and Variable Rate Shading.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<h3><strong>FIDELITYFX</strong></h3>\r\n\r\n<h3><strong>IMAGESHARPING</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>THIN &amp; LIGHT</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The MSI Delta 15 A5EFK-095VN laptop is designed to be extremely thin and light so gamers can carry it around every day or play games, study and work in any environment.</p>\r\n\r\n<h3><strong>LIGHT UP YOUR STYLE</strong></h3>\r\n\r\n<p>Customize your RGB lighting keyboard with Mystic Light from MSI Center to match your unique gaming style.</p>\r\n\r\n<p>Not stopping there, the MSI Delta 15 A5EFK-095VN Laptop can also resume immediately from sleep mode.&nbsp;Its performance will be continued in a period of usually less than a second and help you get back to the game faster.</p>\r\n\r\n<p>Faster login, faster instant-on, highly efficient hibernation, faster Wi-Fi connection and notification calls are all that MSI wants to tell you about the new functionality. this &quot;&nbsp;<strong>Modern Standby</strong>&nbsp;&quot;.</p>\r\n\r\n<h3><strong>SMOOTH AND FAST DISPLAY</strong></h3>\r\n\r\n<p>Tailor-made and highly optimized for gamers, Delta 15 comes with high refresh rates and smooth visuals, giving you the ultimate gaming experience at peak screen frequencies up to 240Hz.</p>\r\n\r\n<h3><strong>MULTI-TASK WITH UP TO 3 MONITORS</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Expand your vision across multiple monitors with HDMI and USB Type-C display connectors, and enjoy up to 4K (3840x2160) resolution output for added productivity and fun. is Matrix Display.</p>\r\n\r\n<h3><strong>PERFORM WITH MORE POWER</strong></h3>\r\n\r\n<p>Rechargeable battery life is also an indispensable part of this classy MSI Delta 15 A5EFK-095VN Laptop.&nbsp;It offers incredible runtimes, non-stop fun and non-stop gaming with its massive 82Whrs rechargeable battery capacity.</p>\r\n\r\n<h3><strong>REVOLUTIONARY COOLING FOR NEXT-GEN GAMING</strong></h3>\r\n\r\n<p>By enlarging the inner diameter of the heat pipe and using MSI&#39;s proprietary heatsink grease to ensure maximum performance during extreme gaming, MSI has implemented a dedicated cooling solution on the CPU and GPU in this Delta 15 version with 2 super-wide fans and 6 super-wide heat pipes.</p>\r\n\r\n<h3><strong>POWER THAT LEADS IN THE LATEST STANDARD DDR4-3200 MEMORY</strong></h3>\r\n\r\n<p>&ldquo;Take advantage of the powerful performance from your laptop with support for the latest DDR4-3200 memory, and enjoy faster system speeds and responsiveness, the new standard that will bring the Take your gaming experience to the next level up to 10% and 35%&rdquo; is the true power of DDR4-3200 memory.</p>\r\n\r\n<h3><strong>THE WAY MUSIC SHOULD BE</strong></h3>\r\n\r\n<h3><strong>ELEVATE YOUR AUDIO</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>GET ALL THE BUFFS</strong></p>\r\n\r\n<p>The exclusive MSI Hub helps you control and customize your MSI laptop just the way you want it.&nbsp;It is not only used to monitor, adjust, and optimize useful features built into a unified system.&nbsp;It also offers maximum flexibility with new functions like Smart Image Finder, UI Skin options and more to customize your personal preferences.</p>\r\n\r\n<h3><strong>WINDOWS 11 BRINGS YOU CLOSER TO WHAT YOU LOVE</strong></h3>\r\n\r\n<p>Chatting online with family and friends struggling or creating content, music is becoming an obsession!?&nbsp;Forget that because Windows 11 will be the only place to help you all.&nbsp;Really?&nbsp;With a fresh feel and special tools, Delta 15 with Windows 11 Home/Pro makes it easier to be more productive and it always has what you need for whatever comes next.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',1.900,'35.7 x 24.7 x 1.9','yes','Win 11 Home',82,12,'2023-03-09 07:55:56','2023-03-09 07:55:56'),(25,50,'<h2>APPLE<strong>&nbsp;</strong>MacBook Pro 2020 MYD92SA / A laptop is a high-end laptop designed with an ultra-light weight, creating convenience in moving. The laptop also owns a small processor but brings a great performance, helping to quickly handle all tasks.</h2>','<h3><strong>The design is highly portable, the ultra-light weight is only 1.4 kg, high-quality materials create luxury</strong></h3>\r\n\r\n<p>MacBook Pro 2020 MYD92SA / A brings luxurious beauty with a simple design and a familiar apple logo to create a highlight in the lid. The computer weight is super light, with only 1.4 kg so that users can take their laptop anywhere, whether at work or on long trips.</p>\r\n\r\n<p><img alt=\"Laptop APPLE MacBook Pro 2020 MYD92SA/A | Thiết kế sang trọng\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/may-tinh-xach-tay-laptop-macbook-pro-2020-13-3.jpg\" /></p>\r\n\r\n<p>The Macbook is made of high-quality materials with standard durability. In addition to protecting the safety of components on the inside, the sturdy frame also helps to create a delicate outer shell, enhancing aesthetic value.</p>\r\n\r\n<p><img alt=\"Laptop APPLE MacBook Pro 2020 MYD92SA/A | Trọng lượng siêu nhẹ, Chất liệu cao cấp \" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/may-tinh-xach-tay-laptop-macbook-pro-2020-13-3-1.jpg\" /></p>\r\n\r\n<h3><strong>Screen with IPS panel, screen size 13.3 inches, sharp images with a resolution of 2560 x 1600; equipped with HD Webcam quality</strong></h3>\r\n\r\n<p>MacBook Pro 2020 owns a screen with a size of 13.3 inches and a modern IPS panel. Along with that is a high resolution of 2560 x 1600 that helps images displayed on the screen with sharp quality, full depth and detail. Image colors are also faithfully reflected thanks to the IPS panel above.</p>\r\n\r\n<p><img alt=\"Laptop APPLE MacBook Pro 2020 MYD92SA/A | Màn hình 13.3 \" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/may-tinh-xach-tay-laptop-macbook-pro-2020-13-3-2.jpg\" /></p>\r\n\r\n<p>The laptop is equipped with an HD-quality Webcam for clear images and less blurred and broken focus. As a result, when you need to meet online or study online through software such as Zoom, users can rest assured to use the MacBook Pro 2020 to study or work effectively.</p>\r\n\r\n<h3><strong>Incredible performance with Apple M1 processor, equipped with 4GB RAM and large internal memory up to 512GB</strong></h3>\r\n\r\n<p>MacBook Pro 2020 achieves outstanding performance and quickly handles various tasks thanks to the new technology application chip Apple M1. This is also a chip that has been created based on modern 5-nanometer processing technology.</p>\r\n\r\n<p><img alt=\"Laptop APPLE MacBook Pro 2020 MYD92SA/A | Hiệu năng mạnh mẽ\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/may-tinh-xach-tay-laptop-macbook-pro-2020-13-3-3.jpg\" /></p>\r\n\r\n<p>The M1 also has a unified memory architecture with high bandwidth, low latency. This significantly improves usage efficiency and energy efficiency. Faster video processing speed. The game is richer and more detailed and the image processing is surprisingly fast, which enhances the user experience.</p>\r\n\r\n<p>In addition, the laptop is also equipped with a 4GB RAM for a very high bus speed of 3733MHz, helping the Macbook Pro to multitask well many tasks and minimize unwanted lag while in use. The storage of the computer is also quite impressive with a capacity of 512G.</p>\r\n\r\n<p><img alt=\"Laptop APPLE MacBook Pro 2020 MYD92SA/A | Dung lượng lưu trữ thoải mái \" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/may-tinh-xach-tay-laptop-macbook-pro-2020-13-3-4.jpg\" /></p>\r\n\r\n<p>With such a large capacity, in addition to storing unlimited important data at work, users can also download their favorite software or some games for entertainment without worrying about filling up memory too quickly.</p>\r\n\r\n<h3><strong>Equipped with Wifi 6, Bluetooth 5.0 towards extended connectivity; Thunderbolt 3 port for fast transfer speeds</strong></h3>\r\n\r\n<p>MacBook Pro 2020 has good compatibility with wireless connections when equipped with Wifi 6 and Bluetooth 5.0 standards. High Internet connection speeds allow users to access the network faster. Bluetooth 5.0 also offers more efficient data transfer speeds than previous versions.</p>\r\n\r\n<p><img alt=\"Laptop APPLE MacBook Pro 2020 MYD92SA/A | Wifi 6, Bluetooth 5.0\" src=\"https://tmp.phongvu.vn/wp-content/uploads/2021/03/may-tinh-xach-tay-laptop-macbook-pro-2020-13-3-5.jpg\" /></p>\r\n\r\n<p>In addition, the laptop is also equipped with 2 Thunderbolt 3 ports with good compatibility with USB-C cables. With the Thunderbolt 3 port, the transfer speed will be 2 times faster than its predecessor Thunderbolt 2, allowing data to travel at 40Gbps with a cable length of 0.5m.</p>\r\n\r\n<p>In addition, to help the laptop protect the privacy as well as personal information of each user, Apple has also added an extremely convenient fingerprint security feature.</p>',1.400,'21.24 x 30.41 x 1.56','HD','macOS',NULL,24,'2023-03-09 07:58:21','2023-03-20 08:41:28'),(26,51,'<h2>Macbook Pro M2 - MNEQ3SA / A is a famous high-end laptop line from Apple. Not only possessing a beautiful and classy appearance, MacBook Pro M2 also leaves a deep impression with a powerful upgraded performance that improves much more than the old version, surely this is the perfect support device for you from study, work to entertainment.</h2>','<h3><strong>Trendy classy appearance, thin and light design</strong></h3>\r\n\r\n<p>MacBook Pro M2 2022 has a beautiful design that is meticulously crafted with a very solid&nbsp;<strong>monolithic metal</strong>&nbsp;shell, the back is printed with a very characteristic apple logo with extremely high brand recognition, always the focus of attracting all eyes and leaving a strong impression on those around them.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Thiết kế sang trọng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_92935afd-edf8-42a5-ae41-6c39e1cf51fe.png\" /></p>\r\n\r\n<p>In addition, MacBook Pro M2 also scores points with everyone when it owns a fairly thin and light design with a weight of only 1.4kg and dimensions of&nbsp;<strong>30.41 x 21.24 x 1.56cm</strong>&nbsp;giving you the ability to move flexibly easily put in a bag or backpack, carry the device with you everywhere for convenience<strong>.</strong></p>\r\n\r\n<h3><strong>Brilliant realistic Retina display, professional task handling thanks to the outstanding powerful M2 chip</strong></h3>\r\n\r\n<p>MacBook MNEQ3SA / A owns a modern&nbsp;<strong>13.3-inch</strong>&nbsp;Retina display along with a&nbsp;<strong>resolution of 2560 x 1600px</strong>&nbsp;for displaying images with vivid quality and clarity to every detail. There is also&nbsp;<strong>support for HD webcams</strong>&nbsp;so you can easily call videos with relatives and friends closely or join convenient online meetings.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Màn hình\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_8f454568-eae4-4666-8229-1c34aa100b0a.png\" /></p>\r\n\r\n<p>Besides, MacBook is equipped with a powerful new generation&nbsp;<strong>M2 chip</strong>&nbsp;with&nbsp;<strong>8 CPU</strong>&nbsp;cores and&nbsp;<strong>10 GPU cores</strong>&nbsp;that allow you to handle all tasks smoothly and smoothly from designing or editing images and videos on Adobe software such as Premiere, Photoshop,... are convenient and easy.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Hiệu năng mạnh mẽ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_3e97f016-2967-4873-9aef-493c043afdd1.png\" /></p>\r\n\r\n<h3><strong>512GB SSD standard hard drive, 8GB RAM multitasking</strong></h3>\r\n\r\n<p>MacBook Pro owns an&nbsp;<strong>SSD&nbsp;</strong>standard hard drive up to&nbsp;<strong>512GB</strong>&nbsp;to help speed up the device, access applications quickly and give you a huge storage space so you can comfortably store all information or data to study and work effectively.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Dung lượng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_b0e7ab65-2551-48b3-8970-2ba616173a3d.png\" /></p>\r\n\r\n<p>Not only that, the MacBook Pro 2022 also owns&nbsp;<strong>8GB of RAM</strong>&nbsp;memory so you can comfortably perform multi-tasking at the same time while the machine still works very smoothly, without lag in the middle, unexpected stand-up or slow response.</p>\r\n\r\n<h3><strong>Support a variety of secure connection ports, handy LED keyboard</strong></h3>\r\n\r\n<p>MacBook Pro MNEQ3SA / A is equipped with a variety of communication ports including:&nbsp;<strong>2 Thunderbolt ports</strong>&nbsp;and a headphone jack with a size of 3.5mm for you to easily connect to other peripherals as you like. Along with that is WiFi&nbsp;<strong>802.11ax (Wifi 6) and Bluetooth 5.0</strong>&nbsp;connectivity so you can connect to the internet and transfer data quickly.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_30de1336-e147-442b-b6b8-724616a8ba30.png\" /></p>\r\n\r\n<p>More specifically, the genuine MacBook Pro is also equipped with a handy&nbsp;<strong>LED keyboard</strong>, which supports you to easily type and limit typing wrong characters in low-light environments. The distance between keys is also very reasonable so that you can manipulate keys quickly and easily. In addition, the device is also supported with integrated&nbsp;<strong>fingerprint security</strong>, helping customers unlock faster when using.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Bảo mật vân tay\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_9a46f417-9a81-4415-a782-376b71e1107a.png\" /></p>\r\n\r\n<h3><strong>Equipped with a battery line with a huge duration, macOS operating system</strong></h3>\r\n\r\n<p>This MacBook Pro 2022 is also equipped with a&nbsp;<strong>battery</strong>&nbsp;line with a huge battery life of up to 20 hours so you can comfortably surf the web or play light games for a long time. In addition, when the battery runs out, you just need to plug in and wait for a few hours to be able to return to use.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Thời lượng pin\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_0a35633f-0de7-46b2-ba86-ef7ea497eb61.png\" /></p>\r\n\r\n<p>Apple has equipped the MacBook Pro 2022 with a safe and secure&nbsp;<strong>MacOS operating system</strong>&nbsp;with a very beautiful interface, very easy to use. The macOS operating system also upgrades the utility features that support you in work, study or entertainment are very interesting and great.</p>\r\n\r\n<p><img alt=\"MacBook Pro M2 - MNEQ3SA/A | Hệ điều hành\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/9/28/20220928_2ee9af86-433d-475d-adde-f4024b369967.png\" /></p>\r\n\r\n<p>&nbsp;</p>',1.400,'30.41 x 21.24 x 1.56','HD','macOS',NULL,12,'2023-03-09 08:02:23','2023-03-20 08:36:51'),(27,52,'<h2><strong>MSI launched the super product Katana 15 B13VEK to meet all the gaming needs of users.&nbsp;Produced by MSI with careful design and investment from leading components, promises a great product for game enthusiasts to fight with friends.</strong></h2>\r\n\r\n<p><strong>&ldquo;Defend your honor and defeat the enemy.&nbsp;Awaken your inner strength and inherit the Dragon&#39;s will.&nbsp;In your hands is the Sword of the Dragon, filled with ancient power and engraved with the runes of the wind to take down any enemy that stands in your way with the legendary Japanese sword Katana from MSI.&quot;&nbsp;This is the heroic introduction from MSI.</strong></p>','<h3><strong>Powerful design bold gaming&nbsp;</strong></h3>\r\n\r\n<p>The MSI Katana 15 laptop owns each strong square line covered with a black personality.&nbsp;The frame is made of high-quality materials to create rigidity for all components inside the MSI laptop.&nbsp;Weighing only about 2.25kg, it is very easy to put it in a backpack to take anywhere.&nbsp;</p>\r\n\r\n<p><img alt=\"MSI Gaming Katana 15 B13VEK-252VN (ảnh 6)\" src=\"https://fptshop.com.vn/Uploads/images/2015/0511/MSI-Gaming-Katana-15-B13VEK-6.jpg\" /></p>\r\n\r\n<h3><strong>Easy-to-operate keyboard</strong></h3>\r\n\r\n<p>The keyboard of the MSI Katana 15 provides a stable key bounce with deep key travel that feels comfortable for every press.&nbsp;Equipped with a 4-zone LED backlight system to add a strong and attractive personality.&nbsp;Besides, manipulating in low-light environments is also more accurate, easily achieving the desired goal in all circumstances.&nbsp;</p>\r\n\r\n<p><img alt=\"MSI Gaming Katana 15 B13VEK-252VN (ảnh 4)\" src=\"https://fptshop.com.vn/Uploads/images/2015/0511/MSI-Gaming-Katana-15-B13VEK-4.jpg\" /></p>\r\n\r\n<h3><strong>Outstanding configuration for gaming</strong></h3>\r\n\r\n<p>MSI Katana 15 is equipped with an Intel Core i7-13620H processor with a base clock of 3.6GHz that can be upgraded to 4.9GHz.&nbsp;6 Performance cores and 4 Efficiency cores for better multitasking and running demanding games.&nbsp;All operations from basic office to advanced design cannot make this laptop difficult.</p>\r\n\r\n<p>Combined with the NVIDIA GeForce RTX 4050 VGA, it provides a beautiful graphics experience with smooth processing speed in every frame.&nbsp;MSI gaming laptops can meet all the harsh requirements of users in any high-profile game such as FPS, MOBA,...</p>\r\n\r\n<p><img src=\"https://anphat.com.vn/media/lib/22-02-2023/msi_katana_15_b13v_1.jpg\" /></p>\r\n\r\n<h3><strong>Sharp Full HD screen on MSI Katana 15 B13VEK 252VN</strong></h3>\r\n\r\n<p>MSI Katana 15 has a 15.6-inch Full HD screen size, extremely sharp 1920x1080 resolution.&nbsp;Fast processing speed with high smoothness on the 144Hz screen completely cuts lag and screen blur when playing games.&nbsp;Now users don&#39;t need to spend a lot of time going to high-quality net shops when this MSI gaming laptop can meet all their needs at home or anywhere.</p>\r\n\r\n<p><img src=\"https://bizweb.dktcdn.net/100/329/122/files/katana-15-b13v-2.jpg?v=1675753449739\" /></p>\r\n\r\n<p>&nbsp;</p>',2.200,'35.9 x 25.9 x 2.49','yes','Win 11 Home',53,12,'2023-03-09 08:06:26','2023-03-20 08:47:13'),(28,53,'<h3><strong>The MSI GP66 Leopard 11UE&nbsp;</strong>laptop&nbsp;enhances performance with its 11th generation Intel Core processor combined with NVIDIA GeForce RTX discrete graphics, so you can enjoy super-smooth gaming and content creation.&nbsp;The high-end gaming laptop promises to be an effective assistant for your favorite game battles.&nbsp;</