ives gaming laptops outstanding graphics processing capabilities.&nbsp;Top-notch games as well as content creation, graphic design will no longer be difficult for MSI laptops thanks to its amazingly smooth performance.</p>\r\n\r\n<p>The 512GB SSD M.2 NVMe hard drive significantly supports the boot-up process, faster data access.&nbsp;Internal memory provides quite comfortable capacity for your data storage, software download needs.&nbsp;</p>\r\n\r\n<p><strong>Licensed Windows 10 operating system, extended connection support</strong></p>\r\n\r\n<p>MSI GP66 Leopard helps you experience full license Windows at no cost when pre-installed with Windows 10 Home 64-bit operating system.&nbsp;Windows 10 provides regular security features, preventing threats so that your system is always safe&hellip;</p>\r\n\r\n<p>The gaming laptop is integrated with connection ports such as: 1 HDMI port, 1 mini DisplayPort, 3 USB 3.2 ports, 2500 Mbps LAN to support quick connection to peripherals.&nbsp;AMD Wi-Fi 6E, Bluetooth 5.2 delivers amazingly fast wireless connectivity with high-speed, wide-bandwidth band, allowing you to play games and work without interruption.&nbsp;</p>\r\n\r\n<p><strong>Gaming-style RGB keyboard, moderate battery life&nbsp;</strong></p>\r\n\r\n<p>The GP66 Leopard 11UE-643VN has a comfortable keyboard space with a neat layout, solid construction and deep key travel so you don&#39;t miss a beat in battle.&nbsp;Beautiful RGB lighting effects give a fresh and professional feel.&nbsp;Touchpad design is moderate with smooth surface for smooth and flexible movement.</p>\r\n\r\n<p><img alt=\"Tản nhiệt mát mẻ, bổ sung phần mềm chơi game mượt mà\" src=\"https://cdn2.cellphones.com.vn/x,webp,q100/media/wysiwyg/laptop/laptop-msi-gp66-leopard-11ue-643vn-i7-11800h-2.jpg\" /></p>\r\n\r\n<p>MSI equips the new generation laptop with a 4-cell 65Wh battery, allowing you to entertain comfortably without worrying too much about running out of battery halfway.&nbsp;You can also fully charge the computer quickly, in just about 90 minutes without having to wait too long.&nbsp;</p>\r\n\r\n<p><strong>Buy genuine MSI GP66 Leopard 11UE-643VN laptop at LapXuong Store showroom | 12 months warranty support</strong></p>\r\n\r\n<p>MSI GP66 Leopard 11UE-643VN is indeed a desirable laptop, meeting your high performance needs.&nbsp;Currently, Phong Vu is supporting attractive discount offers with a prestigious 2-year product warranty.&nbsp;So don&#39;t hesitate to visit <strong>LapXuong Store&nbsp;showroom</strong>&nbsp;to shop!&nbsp;</p>',2.400,'35.8 x 26.7 x 2.34','yes','Win 11',65,12,'2023-03-09 08:37:11','2023-03-20 08:49:32'),(29,54,'<h2>Laptops Lenovo ThinkPad X1 Nano Gen 2 21E8003FVN owns all the elements that make a high-end product. Not only with luxurious and modern design but also powerful performance with Intel Core i7 and large capacity memory. This will be a device that not only serves basic office needs but also supports many other complex tasks well.</h2>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_13d6a87b-0247-4635-a030-fb76954270f7.png\" /></p>','<h3><strong>Luxurious and compact design, convenient 180 degrees folding ability</strong></h3>\r\n\r\n<p>Lenovo ThinkPad X1 Nano Gen 2 laptop is designed with the main&nbsp;<strong>black tone</strong>&nbsp;to bring a feeling of simplicity, modernity but equally sophisticated and high-end. Besides, with dimensions of&nbsp;<strong>29.33 x 20.81 x 1.48cm</strong>&nbsp;and a weight of&nbsp;<strong>only 1kg</strong>, it is extremely compact, convenient for you to carry when going to work and school,...</p>\r\n\r\n<p>The hinge of the Lenovo ThinkPad X1 is intelligently designed with the ability to unfold 180o. A detail that seems simple but brings a wider, more convenient perspective. This also makes it easy to share information on the screen with the other person or when working in a team.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_3c713c26-e094-4799-94c6-eec75ed8b9d6.png\" /></p>\r\n\r\n<h3><strong>Sharp display quality and tight security system</strong></h3>\r\n\r\n<p>The ThinkPad X1 is designed with a&nbsp;<strong>13-inch&nbsp;</strong>screen and&nbsp;<strong>anti-glare</strong>&nbsp;capabilities for greater viewing angles as well as more effective eye protection. Not only that, with a resolution of up to&nbsp;<strong>2160 x 1350 pixels</strong>&nbsp;and&nbsp;<strong>an IPS</strong>&nbsp;panel, you have an extremely sharp, realistic visual experience with bright and extremely vivid colors.</p>\r\n\r\n<p>The keyboard of the Lenovo ThinkPad laptop is supported with&nbsp;<strong>LED lighting</strong>&nbsp;so that you can still use it easily in low light conditions. Besides, it also increases the aesthetics of your laptop.</p>\r\n\r\n<p>Lenovo laptops also support an extremely tight security system with&nbsp;<strong>fingerprint security</strong>. Not only does it help protect the data in the machine better, but it also saves a lot of time. Instead of entering a password, you can now open the device immediately with just one touch.</p>\r\n\r\n<h3><strong>Powerful performance and graphics chip</strong></h3>\r\n\r\n<p>Lenovo X1 21E8003FVN laptop is designed with&nbsp;<strong>7th generation Intel Core i12 1260P processor (2.1 GHz - 4.7 GHz / 18MB / 12 cores, 16 threads).</strong>&nbsp;Laptops provide fast processing speed and smooth operation when performing basic tasks such as office informatics or basic entertainment. Besides, it also supports more complex tasks such as gaming or graphics.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_a6413389-09e2-44aa-8059-5574942f3590.png\" /></p>\r\n\r\n<p>In addition, the laptop also supports&nbsp;<strong>Intel Iris Xe Graphics&nbsp;</strong>graphics chip to bring the ability to balance parameters to make colors more beautiful and accurate. The graphics chip also supports creating large files and exporting in up to 4K quality.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_68f6648f-a9e8-41f4-ae67-7f931060e6a0.png\" /></p>\r\n\r\n<h3><strong>Smooth multitasking and memory with huge capacity</strong></h3>\r\n\r\n<p>Lenovo X1 Nano Gen 2 uses&nbsp;<strong>16GB</strong>&nbsp;of&nbsp;<strong>LPDDR5</strong><strong>&nbsp;RAM</strong>&nbsp;for&nbsp;<strong>a bus speed of 5200MHz</strong>. You can use multiple applications at the same time or perform multiple operations simultaneously without worrying about stuttering, lag or slow response. As a result, work efficiency will be improved as well as bring better entertainment experiences.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_910a21cf-31c8-415d-a354-0d94ec6769d7.png\" /></p>\r\n\r\n<p>The ThinkPad X1 Nano laptop is provided by Lenovo with&nbsp;<strong>a 1TB M.2 NVMe SSD</strong>&nbsp;storage system. With a &quot;huge&quot; capacity, you can comfortably store data such as text, images, software, games or graphics data without using additional memory cards, USB sticks or online storage systems.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Diverse connection ports and convenient wireless connection support</strong></h3>\r\n\r\n<p>ThinkPad X1 21E8003FVN fully supports common and necessary connectors. To transfer data or connect to other devices you can use&nbsp;<strong>2 x Thunderbolt 4</strong>. In addition, the laptop also supports&nbsp;<strong>Audio combo</strong>&nbsp;to help you output audio to external speakers or connect headphones.</p>\r\n\r\n<p>Lenovo ThinkPad X1 is designed with convenient and fast wireless connections. The laptop supports&nbsp;<strong>802.11ax WiFi connection (Wifi 6)&nbsp;</strong>to optimize Internet connection speed and&nbsp;<strong>Bluetooth 5.1</strong>&nbsp;supports data transfer and connection to other devices such as removable keyboards, mice, headphones,...</p>\r\n\r\n<h3><strong>Large battery capacity and keyboard equipped with LED lights</strong></h3>\r\n\r\n<p>The ThinkPad X1 laptop uses a battery with a capacity of up to&nbsp;<strong>50Wh</strong>&nbsp;that allows continuous use for hours after full charge. You can take your laptop with you to work or school without carrying a bulky charging cord.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_4696cc9f-791f-4430-b29f-ebde392b4583.png\" /></p>\r\n\r\n<p>When buying Lenovo ThinkPad X1 Nano you will be supported to install&nbsp;<strong>Windows 11 Pro&nbsp;</strong>operating system for free. Compared to the previous generation of Windows 10, this version has many improvements. The operating system owns a more diverse application store, smoother operation with many new features such as interface customization, convenient split-screen operation,...</p>\r\n\r\n<p>&nbsp;</p>',1.000,'29.33 x 20.81 x 1.48','FHD','Windows 11',50,36,'2023-03-09 08:45:25','2023-03-20 08:52:26'),(30,55,'<p><strong>Laptop MSI Summit E14&nbsp;Evo A12M-211VN</strong>&nbsp;l&agrave;&nbsp;tuyệt t&aacute;c xuất sắc nhất đều từ&nbsp;th&agrave;nh quả&nbsp;thiết kế tinh tế v&agrave; t&iacute;nh to&aacute;n kĩ lưỡng. C&ocirc;ng nghệ kết hợp với thẩm mỹ&nbsp;đ&atilde; dung h&ograve;a phong c&aacute;ch thiết kế hậu hiện đại c&ugrave;ng với c&aacute;c c&ocirc;ng nghệ mới nhất để mang lại cảm hứng cho c&aacute;c doanh nh&acirc;n.</p>\r\n\r\n<p><img src=\"https://bizweb.dktcdn.net/100/329/122/files/summit-e14-02-2.jpg?v=1663906846389\" /></p>','<p><strong>Summit E14&nbsp;EVO</strong>&nbsp;trang bị bản lề 180 độ, được chứng nhận với nền tảng Intel&nbsp;Evo v&agrave; được hỗ trợ bởi bộ xử l&yacute; Intel&nbsp;Core&nbsp;i7 thế hệ 12th.&nbsp;H&atilde;y tận hưởng những trải nghiệm với&nbsp;hiệu suất cao của&nbsp;<strong>Summit E14 Evo</strong>.</p>\r\n\r\n<p><strong>Hiệu năng kh&ocirc;ng giới hạn</strong></p>\r\n\r\n<p><strong>Summit E14 EVO</strong>&nbsp;được trang bị vi xử l&iacute; Intel&nbsp;Core&nbsp;i7 thế hệ 12 mới nhất &amp; chip đồ họa Intel&nbsp;Iris&nbsp;Xe, mang lại hiệu năng hạng nặng trong một th&acirc;n m&aacute;y cực gọn nhẹ v&agrave; cơ động, sẵn s&agrave;ng gi&uacute;p bạn theo s&aacute;t c&ocirc;ng việc d&ugrave; cho đang ở bất cứ nơi đ&acirc;u.</p>\r\n\r\n<p><strong>M&agrave;n h&igrave;nh tỷ lệ v&agrave;ng</strong></p>\r\n\r\n<p><strong>Summit E14 Evo</strong>&nbsp;được thiết kế kĩ lưỡng tu&acirc;n theo Tỉ lệ v&agrave;ng 1.618:1&nbsp;v&agrave; th&agrave;nh quả ch&iacute;nh l&agrave; m&agrave;n h&igrave;nh tỉ lệ 16:10. M&agrave;n h&igrave;nh 14-inch FHD&nbsp;tỉ lệ 16:10 gi&uacute;p mang lại kh&ocirc;ng gian hiển thị th&ocirc;ng tin rộng hơn tr&ecirc;n một th&acirc;n m&aacute;y thiết kế vẫn gọn g&agrave;ng v&agrave; tinh xảo.</p>\r\n\r\n<p><strong>Ổ cứng tốc độ cao</strong></p>\r\n\r\n<p><strong>Summit E14&nbsp;Evo</strong><strong>&nbsp;</strong>hỗ trợ PCIe Gen 4.0 gi&uacute;p tăng tốc độ xử l&yacute; c&ocirc;ng việc v&agrave; cho độ ổn định với t&iacute;n hiệu cực cao để cải thiện hiệu suất của m&aacute;y.</p>\r\n\r\n<p><strong>Kết nối kh&ocirc;ng d&acirc;y ho&agrave;n hảo</strong></p>\r\n\r\n<p><strong>Summit E14&nbsp;Evo&nbsp;</strong>trang bị chuẩn Wi-Fi 6E mới cho tốc độ đ&aacute;ng kinh ngạc trong khi vẫn đảm bảo kết nối mượt m&agrave; ổn định ngay cả khi c&oacute; nhiều người c&ugrave;ng sử dụng. Với băng th&ocirc;ng cực cao v&agrave; độ trễ thấp, bạn c&oacute; thể tận hưởng trải nghiệm stream video mượt m&agrave; hơn, hoặc truyền c&aacute;c file dữ liệu lớn trong t&iacute;ch tắc.</p>\r\n\r\n<p><strong>Tối ưu&nbsp;khả năng di động</strong></p>\r\n\r\n<p><strong>Summit E14&nbsp;Evo</strong>&nbsp;cho thời lượng pin sử dụng cực cao, đồng thời c&ograve;n c&oacute; thể xoay hoặc gập m&agrave;n h&igrave;nh ở nhiều g&oacute;c độ kh&aacute;c nhau nhằm đ&aacute;p ứng nhu cầu của bạn. Mẫu laptop 2-trong-1 c&oacute; thời lượng pin cực cao c&ugrave;ng khả năng sạc nhanh n&agrave;y dễ d&agrave;ng th&iacute;ch ứng với mọi m&ocirc;i trường sử dụng. Thiết kế linh hoạt cho ph&eacute;p người d&ugrave;ng l&agrave;m việc v&agrave; giải tr&iacute; v&agrave;o bất cứ l&uacute;c n&agrave;o, ở bất cứ nơi đ&acirc;u.</p>\r\n\r\n<p><strong>N&acirc;ng tầm video call</strong></p>\r\n\r\n<p>Tận hưởng chất lượng h&igrave;nh ảnh tuyệt hảo khi họp online với giải ph&aacute;p to&agrave;n diện của&nbsp;<strong>Summit E14&nbsp;Evo&nbsp;</strong>nhờ trang bị camera(IR) với độ ph&acirc;n giải FHD gi&uacute;p nhận diện khu&ocirc;n mặt, bạn&nbsp;</p>',1.600,'31.4 x 22.75 x 1.79 mm','yes','Win 11',72,12,'2023-03-09 08:50:13','2023-03-20 08:55:55'),(31,56,'<h2>Laptop Lenovo ThinkPad E15 Gen 4 21E600CMVA simple black tones luxurious with an impressive, durable unique design accompanied by a top-notch internal configuration thanks to the 7th generation Intel Core i12 processor. Laptop products are suitable for all audiences from students to office workers, meeting office tasks or making graphics well.</h2>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkPad E15 Gen 4 21E600CMVA\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_6e1b1b5d-dea8-4977-810c-47437c6401b4.png\" /></p>','<h3><strong>Exquisite design full of luxury, convenient compact size</strong></h3>\r\n\r\n<p>Lenovo ThinkPad E15 Gen 4 21E600CMVA laptop wears a classic, elegant and luxurious<strong>&nbsp;black</strong>&nbsp;shell, providing a classy and professional look. Lenovo and ThinkPad logos are designed symmetrically on the back to create a harmonious whole, although simple but equally attractive.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkPad E15 Gen 4 21E600CMVA | Thiết kế sang tọng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_311b12bd-98f8-480d-bb28-0c88825b4cdc.png\" /></p>\r\n\r\n<p>The 2nd impression of the Lenovo ThinkPad E15 is that it is quite compact, portable with dimensions of<strong>&nbsp;36.5 x 24.0 x 1.89cm</strong>&nbsp;and a weight of only&nbsp;<strong>1.7kg</strong>, very easy to put in a backpack and take anywhere you need to use, important meetings or long business trips.</p>\r\n\r\n<h3><strong>15.6-inch screen for a crisp experience, hd webcam support</strong></h3>\r\n\r\n<p>Lenovo ThinkPad E15 laptop owns a 15.6-inch&nbsp;<strong>anti-glare screen</strong>&nbsp;size<strong>, Full HD resolution up to 2K (1920 x 1080px).</strong>&nbsp;Laptops promise you to have a sharp, realistic experience to every detail. Thin screen bezels for a large space for you to focus on work or enjoy vivid entertainment space through games or movies.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkPad E15 Gen 4 21E600CMVA | Màn hình\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_dd478706-9523-4ba4-9783-d8867a2c4d52.png\" /></p>\r\n\r\n<p>Not only that, Lenovo ThinkPad also brings the convenience of supporting&nbsp;<strong>FHD sharp webcam</strong>, helping you to comfortably facetime chat with relatives or study online on software such as Zoom, Google Meet, ...</p>\r\n\r\n<h3><strong>Intel Core i7 Gen 12 processor,</strong>&nbsp;<strong>Intel Iris Xe Graphics</strong></h3>\r\n\r\n<p>Lenovo ThinkPad E15 laptop with outstanding configuration thanks to the new<strong>&nbsp;7th generation Intel Core i1255-12U</strong>&nbsp;processor, just launched in early 2022. Includes&nbsp;<strong>10 cores of 12 threads</strong>&nbsp;and fast response processing speed with a maximum clock speed of&nbsp;<strong>4.7GHz&nbsp;</strong>with&nbsp;<strong>12MB cache.</strong></p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkPad E15 Gen 4 21E600CMVA | Hiệu năng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_e4f5c42b-2bdd-4ce5-bb1e-c6bd8b96ae42.png\" /></p>\r\n\r\n<p>Included with Intel chip is the&nbsp;<strong>Onboard Intel Iris Xe Graphics</strong>&nbsp;chip that has been built into Lenovo ThinkPad to meet the needs of simple graphics such as Word, Excel,... to advanced processing tasks such as graphic design software from Adobe home.</p>\r\n\r\n<h3><strong>8GB RAM, 512GB hard drive</strong></h3>\r\n\r\n<p>The Lenovo ThinkPad supports 8GB&nbsp;<strong>DDR4 Onboard</strong>&nbsp;memory soldered on the motherboard, for a&nbsp;<a href=\"https://phongvu.vn/ram-laptop-scat.01-N002-01\"><strong>RAM</strong></a>&nbsp;bus speed of up to 3200MHz, accompanied by 1&nbsp;<strong>40GB</strong>&nbsp;slot if you feel that 8GB memory is not enough, memory makes handling all tasks smoother and more convenient.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkPad E15 Gen 4 21E600CMVA | Bộ nhớ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_d920a424-e11b-443c-95a5-cd4463e2e56f.png\" /></p>\r\n\r\n<p>In addition, the Lenovo ThinkPad laptop also owns a hard drive with a huge capacity of<strong>&nbsp;512GB M.2 NVMe SSD</strong>, making it possible to comfortably store a lot of your necessary data and help speed up the startup of the machine or programs faster, saving a little waiting time.</p>\r\n\r\n<h3><strong>3 cell&nbsp;45Wh battery, fullsi ze keyboardfull of functions</strong></h3>\r\n\r\n<p>Lenovo ThinkPad laptop is equipped with a<strong>&nbsp;very popular 3-cell 45Wh</strong>&nbsp;battery, you can use it continuously for several hours without worrying about running out of battery midway. If the device runs out of battery, you just need to plug in and wait for a few hours to be able to return to use, continue your unfinished work.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkPad E15 Gen 4 21E600CMVA | Bàn phím\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_0b753e15-cc26-46c8-9e95-0a43361a43c3.png\" /></p>\r\n\r\n<p>The keyboard of the Lenovo ThinkPad is designed&nbsp;<strong>fullsize with LED,</strong>&nbsp;very good key bounce, recessed key buttons hugging the fingertips to make typing easier and more comfortable, without having to worry about hand fatigue due to having to edit text for hours.</p>\r\n\r\n<h3><strong>Diverse utility connection ports, set up fingerprint security system</strong></h3>\r\n\r\n<p>Lenovo ThinkPad E15 supports a variety of utility communication ports pre-set on the machine to satisfy the needs of users including: 1 USB 3.2 port, 1<strong>&nbsp;USB 2.0&nbsp;</strong>port, 1<strong>&nbsp;Thunderbolt 4 port, Audio combo,</strong>&nbsp;1 1<strong>&nbsp;GB / s LAN&nbsp;</strong>port and 1<strong>&nbsp;HDMI</strong>&nbsp;output port<strong>.</strong></p>\r\n\r\n<p>The Lenovo ThinkPad E15 with a smart design has been pre-set by Lenovo&#39;s own fingerprint&nbsp;<strong>security&nbsp;</strong>technology, you do not need to waste time entering passwords, and at the same time bring high safety to users with important personal data in the device</p>\r\n\r\n<p>&nbsp;</p>',1.700,'36.5 x 24.0 x 1.89','FHD','Windows 11',45,24,'2023-03-09 08:51:06','2023-03-20 08:59:38'),(32,57,'<p>Updating</p>','<p>Updating</p>',1.100,'31.56 x 22.25 x 1.536','FHD','Windows 11',57,36,'2023-03-09 08:54:06','2023-03-09 08:54:06'),(33,58,'<h2>Laptop Lenovo ThinkPad T16 Gen 1 21BV00EKVA is a laptop line in the high-end segment of Lenovo with a new, beautiful design with the main basic black tone. Provide outstanding power and utility thanks to the Onboard Intel Iris Xe Graphics chip, providing outstanding work performance, meeting all the needs of students, businesses or office workers.</h2>','<p><img alt=\"Lenovo ThinkPad T16 Gen 1 Laptop 21BV00EKVA\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_496232ba-877c-4df8-815d-71deddd6bd0d.png\" style=\"height:auto\" /></p>\r\n\r\n<h3>Luxurious basic look, flexible design</h3>\r\n\r\n<p>The Lenovo ThinkPad T16 laptop puts on a luxurious mysterious black shirt with the newly updated design of the Lenovo family, giving an attractive and impressive first look, very suitable for the nee