ng>HD webcam</strong>&nbsp;to help you make stable online calls with clearer and more realistic image quality through modern applications such as: Microsoft Teams, Line, Google Meet ,...or chat with family and friends via video call more conveniently.</p>\r\n\r\n<p><img alt=\"Laptop MSI Stealth GS66 12UGS 227VN\" src=\"https://anphat.com.vn/media/lib/14-01-2022/aq.jpg\" /></p>\r\n\r\n<h3><strong>Powerful performance with Intel Core i7-12700H, 32GB DDR5 . Ram&nbsp;</strong></h3>\r\n\r\n<p>The Intel Core i7-12700H processor MSI equips Stealth GS66 12UGS-227VN provides a powerful and smooth performance with an average clock speed of&nbsp;<strong>3.5GHz</strong>&nbsp;, peaking up to Turbo Boost of&nbsp;<strong>4.7GHz . combined with&nbsp;</strong><strong>24MB</strong>&nbsp;cache&nbsp;with&nbsp;<strong>14 cores</strong>&nbsp;,&nbsp;<strong>20 threads</strong>&nbsp;for good multitasking ability, meeting the needs of many gamers today.</p>\r\n\r\n<p>Besides, in order to make the machine more powerful, it must be said that the RAM memory, this laptop is designed with 32GB DDR5 4800MHz (2 slots) for all tasks smoother for users without worrying about happenings. stutters, lags or freezes while in use.</p>\r\n\r\n<h3><strong>Smooth graphics, 1TB SSD&nbsp;</strong></h3>\r\n\r\n<p><strong>The NVIDIA GeForce RTX 3070Ti 8GB GDDR6 / Intel Iris Xe Graphics</strong>&nbsp;graphics chip&nbsp;gives the machine an outstanding powerful performance that delivers better gaming performance as well as better tasks to help users have more enjoyable experiences in different environments. intense game or the most relaxing hours.</p>\r\n\r\n<p><img src=\"https://anphat.com.vn/media/lib/30-12-2021/msi-gs66-matrix-display-new.jpg\" /></p>\r\n\r\n<p><strong>With a 1TB</strong>&nbsp;SSD&nbsp;<strong>M.2 NVMe</strong>&nbsp;hard drive&nbsp;, users not only have a large storage space with the ability to quickly read and write from the hard drive, but it also increases the boot speed for this laptop. to help you do your job as efficiently as possible.</p>\r\n\r\n<h3><strong>Built-in unique RGB lights, using 4-cell battery Instant battery</strong></h3>\r\n\r\n<p>More unique, the MSI Stealth computer has a unique and brilliant&nbsp;<strong>RGB</strong>&nbsp;built-in keyboard , providing an extremely vivid gaming and working space to help you use the machine in a space.&nbsp;Low light is better and gives you the fullness of your very own personality.</p>\r\n\r\n<p>At the same time, the MSI Stealth GS66 12UGS-227VN laptop also has a&nbsp;<strong>4-cell</strong>&nbsp;battery pack included in the body, allowing users to use it continuously for a long time without needing to plug in to charge. Damage or swelling of the battery due to repeated plugging in the charger, increasing the long life of the battery.</p>\r\n\r\n<h3><strong>Modern connectivity, equipped with high-speed Wifi 6</strong></h3>\r\n\r\n<p>Your laptop will be fully equipped with connectivity ports along both sides of the body, with ports such as 2 USB&nbsp;<strong>Type C / DisplayPort</strong>&nbsp;ports ,&nbsp;<strong>2 USB 3.2 ports</strong>&nbsp;,&nbsp;<strong>1 Thunderbolt 4 port, 2500 Mbps LAN</strong>&nbsp;.&nbsp;In addition, the machine is also equipped with HDMI output ports to help you easily connect to other peripherals effectively.</p>\r\n\r\n<p>Wireless connectivity of the machine including&nbsp;<strong>Bluetooth 5.2</strong>&nbsp;is provided to facilitate seamless file sharing.&nbsp;And to ensure a more stable and fast internet connection, the gaming laptop is equipped with&nbsp;<strong>WiFi 802.11ax (Wifi 6)</strong>&nbsp;, providing the smoothest web surfing and gaming experience.</p>\r\n\r\n<p>In order for customers to save installation costs, the manufacturer has equipped the MSI Stealth GS66 12UGS-227VN laptop with&nbsp;<strong>Windows 11 Home</strong>&nbsp;operating system , you can upgrade high-end game software to limit the situation. Internet connection is interrupted or lagged.</p>\r\n\r\n<h3><strong>Buy genuine MSI Stealth GS66 12UGS-227VN (Black) laptop at Phong Vu for free shipping</strong></h3>\r\n\r\n<p>MSI Stealth GS66 12UGS-227VN (Black) with a dynamic appearance, a unique RGB-equipped keyboard combination, and a rather high 1TB SSD hard drive.&nbsp;Currently, the product is being sold at <strong>LapXuong&nbsp;stores</strong>&nbsp;across the country.&nbsp;When you make a purchase, you will receive many attractive offers and free shipping support.</p>\r\n\r\n<p>&nbsp;</p>',2.100,'35.83 x 24.8 x 1.98 cm','yes','Win 11',87,12,'2023-03-09 09:01:39','2023-03-20 09:04:25'),(35,60,'<h2>Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CWVN with a high-end, beautiful appearance. Lenovo ThinkBook 15 also owns powerful performance from modern Intel Core i7 Gen 12 CPU and 8GB RAM for outstanding processing speed, suitable for businesses, students and office workers. This is a product that will definitely bring impressive user experiences.</h2>','<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_829e035e-c216-4397-93d2-eed86d88abbc.png\" style=\"height:auto\" /></p>\r\n\r\n<h3>Compact, durable design - Spacious storage system</h3>\r\n\r\n<p>The Lenovo laptop is designed to be quite compact, allowing you to flexibly carry it to many places thanks to its dimensions of&nbsp;<strong>35.7 x 23.5 x 1.89cm</strong>&nbsp;and a weight of&nbsp;<strong>1.7kg</strong>&nbsp;.&nbsp;In addition, the Lenovo laptop with a shell made from&nbsp;<strong>aluminum alloy</strong>&nbsp;has a fairly solid gray tone that can withstand shocks well.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  Durable Design\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_c204bf0e-7f20-4951-93b7-6a5589b01c71.png\" style=\"height:auto\" /></p>\r\n\r\n<p>Lenovo ThinkBook 21DJ00CSVN owns a hard drive up to&nbsp;<strong>512GB SSD M.2 NVMe&nbsp;</strong>&nbsp;so you can comfortably store a lot of data, start the machine quickly.&nbsp;With&nbsp;<strong>8GB Onboard DDR4 RAM&nbsp; and&nbsp;</strong><strong>3200MHz</strong>&nbsp;bus speed&nbsp;, you can open multiple tasks at the same time without fear of interruption, you can also upgrade more depending on your usage needs thanks to the maximum upgrade support slot.&nbsp;<strong>40GB</strong>&nbsp;max .&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  Memory\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_9a01efca-bdb7-4566-9d16-e9c588a843f7.png\" style=\"height:auto\" /></p>\r\n\r\n<h3>Breakthrough performance - Long-lasting use&nbsp;</h3>\r\n\r\n<p><strong>Lenovo has equipped this laptop with a 12th generation Intel Core i7 - 1255U&nbsp;</strong>&nbsp;processor&nbsp;consisting of&nbsp;<strong>10 cores and 12 threads</strong>&nbsp;, maximum clock speed of&nbsp;<strong>4.7GHz ,&nbsp;</strong><strong>12MB</strong>&nbsp;cache&nbsp;, combined with a graphics card.&nbsp;<strong>GeForce MX550 2GB GDDR6&nbsp;</strong>&nbsp;helps increase image processing capabilities for laptops, promising to bring great entertainment and gaming experiences to users.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  Performance\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_377ac1de-9912-41e8-8b37-ad60e3de2554.png\" style=\"height:auto\" /></p>\r\n\r\n<p>Besides, the usage time of the Lenovo ThinkBook laptop is also quite impressive thanks to the&nbsp;<strong>45Wh instant battery</strong>&nbsp;that allows you to comfortably work with light to heavy tasks and take it outside to work without worry. worry about interruptions.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  The battery\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_6dd5300a-6a97-40e6-9ab8-a3e1dbc614b6.png\" style=\"height:auto\" /></p>\r\n\r\n<h3>Excellent screen quality - Windows 11 Home OS SL&nbsp;</h3>\r\n\r\n<p>The Lenovo ThinkBook 15 G4 IAP has a fairly large&nbsp;<strong>15.6-inch screen,&nbsp;</strong><strong>Full HD&nbsp;</strong>&nbsp;resolution of 1920 x 1080 pixels&nbsp;, providing clear and vivid image quality.&nbsp;Besides, the&nbsp;<strong>IPS&nbsp;</strong>&nbsp;panel and&nbsp;<strong>anti-glare screen</strong>&nbsp;ensure true color quality and limit pain and eye fatigue when used for a long time.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  Screen\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_a6b6e60c-969e-4b86-ad83-85388507fd8f.png\" style=\"height:auto\" /></p>\r\n\r\n<p>The Lenovo home laptop comes pre-installed with&nbsp;<strong>Windows 11 Home SL&nbsp;</strong>&nbsp;operating system with many outstanding advantages compared to previous operating systems.&nbsp;Windows 11 is suitable for many different working models, designing a more user-friendly and smoother interface.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  Windows 11\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_c6077534-ea71-464c-8d24-22e10d14e0b8.png\" style=\"height:auto\" /></p>\r\n\r\n<h3>Secure fingerprint security- Convenient, comfortable keyboard&nbsp;</h3>\r\n\r\n<p>The ThinkBook 15 G4&#39;s keyboard is designed quite simply, the distance and bounce is also quite reasonable, giving you the most comfortable typing moment without hand fatigue.&nbsp;In addition, the keyboard is also equipped with&nbsp;<strong>a numeric keypad</strong>&nbsp;and&nbsp;<strong>LED lights</strong>&nbsp;to help you enter the most accurate data even in low light conditions.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  Keyboard\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_5c3be597-abf1-4bde-82fa-934a1f8eb4b1.png\" style=\"height:auto\" /></p>\r\n\r\n<p>The Lenovo ThinkBook 15 laptop is equipped with one-touch&nbsp;<strong>fingerprint security</strong>&nbsp;without a password for high security.&nbsp;You can set up multiple fingerprints at the same time for flexible unlocking in many cases.</p>\r\n\r\n<h3>Easy Peripheral Expansion - Convenient Wireless Connectivity</h3>\r\n\r\n<p>Lenovo G4 IAP laptop is supported with diverse ports to serve the needs of peripheral expansion and connect to external smart devices suitable for many different business and office operations such as 1 x USB&nbsp;<strong>Type C/ DisplayPort/ Power Delivery, 2 x USB 3.2, 1 x Thunderbolt 4, 1 x SD card slot, Audio combo ,&nbsp;</strong><strong>1 Gb/s LAN&nbsp;</strong>&nbsp;port&nbsp;supporting stable network connection and&nbsp;<strong>HDMI output port.</strong></p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G4 IAP 21DJ00CSVN |  Connector\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_6be4a16d-0a2a-47b8-9e05-9744f35b09fd.png\" style=\"height:auto\" /></p>\r\n\r\n<p>Other wireless connections are also supported on this laptop such as&nbsp;<strong>802.11ac WiFi&nbsp;</strong>&nbsp;for more convenient networking and&nbsp;<strong>Bluetooth 5.2</strong>&nbsp;for easy wireless connectivity.&nbsp;Besides, the company also offers other accompanying accessories to help you save costs such as&nbsp;<strong>Adapter, power cord</strong>&nbsp;.</p>\r\n\r\n<p>&nbsp;</p>',1.700,'35.7 x 23.5 x 1.89','FHD','Windows 11',45,24,'2023-03-09 09:06:12','2023-03-20 09:02:36'),(36,61,'<p>Laptop - Lenovo laptops, especially the Lenovo Thinkbook laptop line , which is known for its high versatility from the early days of its launch, up to now, these Lenovo laptops have continuously had new and better options, stronger. So what&#39;s so special about this 16-inch version? The modern sophisticated design of the <strong>Lenovo ThinkBook 16 G4+ IAP 21CY003GVN</strong> with outstanding performance equipped inside, will surely be an effective partner for everyone in both work and play!</p>','<h3><strong>Neat design, attracting all eyes</strong></h3>\r\n\r\n<p>This <strong>Lenovo ThinkBook 16 G4+</strong> is not much different from previous ThinkBook products. We will still have a square shell with side A divided into two shades of Gray, accompanied by the Lenovo logo and the horizontal ThinkBook word. If you look at it from the outside, it is not easy to get an impression of <strong>the ThinkBook 16 G4+</strong> compared to the products of the same series. However, if compared with other products in the same segment, it is very prominent, partly because of the brand name and partly because of the minimalist and characteristic presentation.</p>\r\n\r\n<p>The perfection of <strong>the Lenovo ThinkBook 16 G4+</strong> , if considered at the price range of about VND 30 million, can also be considered the best. The case is completely made of cool metal, except for the screen border, with a very medium rough coating, the edges are finely cut, small details such as the Diamond Cut border in the touchpad and the power button are also taken care of.</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-10-2022/thitkchactn3.jpg\" style=\"border-style:none; height:auto\" /></p>\r\n\r\n<p><strong>The Lenovo ThinkBook 16 G4+</strong> has a light weight of 1.8 kg and a thickness of 16.5 mm, creating a dynamic laptop generation that easily fits in your backpack, a companion on every trip. More specifically, when the durability of this device is also certified by the military standard MIL STD 810 H durability against unexpected everyday incidents such as collisions, vibrations, high pressure, ... ensure that all your needs are optimally met wherever you are.</p>\r\n\r\n<p>Sharing data is more convenient during teamwork thanks to the innovative 180-degree opening hinge, allowing you to easily fold and open, improving work efficiency.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3><strong>Latest Intel chip for outstanding power</strong></h3>\r\n\r\n<p><strong>Lenovo ThinkBook 16 G4+</strong> is equipped with Intel Core i7 12700H processor with 14 cores 20 threads structure for base clock of 3.50 GHz and overclocking ability up to 4.70 GHz! An impressive chip in the price range! All office operations such as Word, Excel, ... are fully swallowed by this chip, for the best work performance. In addition, the machine also supports you to design products, posters, banners, simple video rendering, ... equally effective.</p>\r\n\r\n<p>When running heavily like with the Cinebench R23 test or rendering RAW images from Adobe Lightroom Classic CC, the clock speed of the i7 -12700H is also kept very stable. This must be thanks to the Thread Director mechanism of Intel 12th Gen, when allocating the chip&#39;s 4 high-performance cores to run at full capacity, helping its performance be boosted. In the meantime, the chip&#39;s temperature will be maintained relatively high, at about 80 degrees Celsius when running single-core and 88 - 93 degrees Celsius when running multi-core. For a performance-oriented machine, this is an acceptable level of heat.</p>\r\n\r\n<p>For graphics tasks such as editing and rendering photos and videos, the NVIDIA Geforce RTX 2050 4GB graphics card equipped on the machine can also participate if you set the appropriate settings (for example, Premiere Pro renders using the CUDA). As for gaming, the basic RTX 2050 can still handle today&#39;s new games with Medium - High graphics. However, we should lower the resolution to 1920 x 1200 instead of the original 2560 x 1600 setting. If you want to use Ray Tracing, enabling DLSS 2.0 will be almost mandatory for gamers to have a good experience. best.</p>\r\n\r\n<p>Users can freely open a variety of applications and switch back and forth without worrying about lag thanks to 16GB of DDR5 standard RAM with 4800MHz RAM Bus speed. 512GB NVMe PCle SSD with built-in SATA HDD slot provides large space for all your necessary data, and supports opening or running applications in a quick time, just seconds.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Wide vision with professional sound</strong></h3>\r\n\r\n<p>The screen of <strong>the Lenovo ThinkBook 16 G4 + IAP 21CY003GVN</strong> is considered comprehensive in the price range of more than 30 million. With a multi-function laptop that can both do office work, play games and design graphics, the screen is definitely a remarkable factor.</p>\r\n\r\n<p>Let your eyes enjoy virtual space in the most realistic way with the thin, clear NanoEdge screen of the <strong>Lenovo ThinkBook 16 G4+ IAP 21CY003GVN laptop. </strong>It has a wide viewing angle and is T&Uuml;V Rheinland certified for low blue light levels, reducing the risk of eye strain during marathon viewing sessions.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-10-2022/thitkchactn7.jpg\" style=\"border-style:none; height:auto\" /></p>\r\n\r\n<p><strong>Lenovo ThinkBook 16 G4+</strong> laptop with 16 Inch WQXGA (2560x1600) IPS high-end screen gives users an excellent color standard, absolute sharp high-end images. Using the device to watch YouTube and Netflix videos, users will love how the colors are reproduced &quot;full&quot; on the ThinkBook 16 G4+ thanks to 100% sRGB color coverage and high contrast (1200:1).</p>\r\n\r\n<p>The brightness of this screen also reaches 350 nits, used in indoor environments with almost no problems. When we go out, we have an Anti Glare anti-glare coating on the device to prevent reflections, helping content such as text, images, ... display more clearly.</p>\r\n\r\n<p>Using the screen to edit photos, the writer is also assured when it has a low Delta E color deviation. The RAW file is good, making it easier to apply presets or drag colors. Those of you who have 2D, 3D design or video coloring needs can almost never have to worry about color accuracy when using the <strong>ThinkBook 16 G4+</strong> .</p>\r\n\r\n<p>Another factor that is also significant on the screen of the <strong>16 G4+</strong> will be the maximum refresh rate of up to 120Hz, making all movements from page scrolling, hovering, .. or playing games appear smooth. The machine also has a version with a 60Hz refresh rate, which will be more suitable if you want to save a bit and just need color quality.</p>\r\n\r\n<p>Dolby Audio Premium technology with the ability to create surround sound effects and the ability to filter out noise significantly improves sound details, allowing you to fully enjoy the relaxing space with music and movies to the fullest. more complete.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Unforgettable typing and touchpad surfing experience</strong></h3>\r\n\r\n<p>Overall, the keyboard and touchpad on the Lenovo Thinkbook are quite similar to the IdeaPad series. The typing feeling is not as deep and huggable as the ThinkPad, but the overall quality on office laptops is still very good. The number pad cluster is as usual a bit smaller for each key to make it easier to distinguish, and below we will still have a white LED light to make it easier to work at night.</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-10-2022/thitkchactn4.jpg\" style=\"border-style:none; height:auto\" /></p>\r\n\r\n<p>The touchpad is what the writer is most satisfied with on the C-side of <strong>the ThinkBook 16 G4+</strong> , with a comfortable feeling of use thanks to the glass coating and large size. This is also perhaps the most significantly upgraded component in terms of experience compared to IdeaPad.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Amazing security</strong></h3>\r\n\r\n<p>Lenovo ThinkBook 16 G4+ Laptop <strong>IAP 21CY003GVN</strong> Core i7 - 12700H takes your privacy and security very seriously. There&#39;s a built-in privacy shield that slides over the webcam for instant privacy, protecting you from prying eyes and distractions.</p>\r\n\r\n<p>One-touch unlock: Accessing your <strong>Lenovo ThinkBook 16 Gen 4+ IAP 21CY003GVN</strong> Core i7-12700H laptop has never been easier and more secure. With a built-in fingerprint sensor on the trackpad and Windows Hello, you don&#39;t have to type in your password all the time, all you need is one touch.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Connection port - Full in both quantity and quality</strong></h3>\r\n\r\n<p>Serving users to the fullest extent in transferring data to different compatible peripherals without cumbersome conversions thanks to common communication ports such as: 2 USB-A 3.2 Gen 1 ports ( port on the left side will always have power), 1 hidden USB-A 2.0 port, 1 USB-C 3.2 Gen2 port, 1 Thunderbolt 4 port, 1 HDMI port, RJ45 LAN port, SD card slot and 3.5 headphone jack mm combo.</p>\r\n\r\n<p>Besides the SD card slot that will satisfy you for taking photos, recording movies, etc., the hidden USB-A 2.0 port is a rather novel element. It will have a separate cover for protection, a bit difficult to open for those who do not have nails. With this hidden A port, users can put a wireless mouse dongle in it and then close it so it won&#39;t be lost. In the future, it is possible that this hidden port will have many other uses.</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-10-2022/thitkchactn.jpg\" style=\"border-style:none; height:auto\" /></p>\r\n\r\n<p>The built-in Windows 11 Home operating system in this version brings a modern, easy-to-use interface with a large application store, giving you a more complete experience.</p>\r\n\r\n<p>Not only that, this Lenovo Thinkbook laptop is also equipped with Wi-Fi 6E 11ax, 2x2 and Bluetooth 5.2 providing super stable transmission both indoors or outdoors, for significantly enhanced work performance.&nbsp;</p>\r\n\r\n<p><em>With a modern, dynamic design in line with current trends and powerful configuration, </em><strong><em>Lenovo ThinkBook 16 G4+ IAP 21CY003GVN</em></strong><em> promises to be an effective companion for anyone.</em></p>',1.800,'35.6 x 25.1 x 1.65','FHD','Windows 11',72,24,'2023-03-09 09:11:50','2023-03-20 09:04:37'),(37,62,'<h2><strong>The MSI Crosshair 15 B12UEZ-460VN laptop&nbsp;is a product with a 12th generation processor along with an optimized, powerful design that fully exerts its full power when playing games to bring a high degree of suitability for users, especially for game enthusiasts.</strong></h2>\r\n\r\n<h3>&nbsp;</h3>','<h3><strong>Mysterious black design bold gaming, standard size</strong></h3>\r\n\r\n<p>MSI Crosshair 15 laptop is a stylish black laptop with a beautiful modern design, a powerful and different appearance that brings excitement to users. This is a laptop line suitable for gaming enthusiasts.</p>\r\n\r\n<p><img alt=\"Laptop MSI Crosshair 15 B12UEZ-460VN | Thiết kế đậm chất gaming\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/6/20220406_6fad25e9-3d9b-4568-adb0-ecec5937b9e1.jpg\" /></p>\r\n\r\n<p>Besides the personality appearance, the dynamic MSI Crosshair 15 B12UEZ laptop also has a standard size of a gaming laptop. With dimensions of 35.9 x 25.9 x 2.69 cm and a mass of 2.3 kg. Suitable for users who are passionate about technology who like to be strong and disruptive.</p>\r\n\r\n<h3><strong>15.6-inch Full HD screen, modern IPS panel for sharp images</strong></h3>\r\n\r\n<p>MSI Crosshair 15 laptop owns a large 15.6-inch screen with a resolution of up to 2K. Along with IPS panels for clear, sharp images give users a realistic experience, perfect image and video viewing or gaming.</p>\r\n\r\n<p><img alt=\"Laptop MSI Crosshair 15 B12UEZ-460VN | Màn hình FULL HD\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/6/20220406_f57b8750-9b13-4a93-840f-5ce1ffced074.jpg\" /></p>\r\n\r\n<p>Understanding the needs of MSI home users has equipped MSI B12UEZ laptops with HD Webcams. Making it easy for users to call videos, learn online easily brings a lot of convenience to users.</p>\r\n\r\n<h3><strong>Outstanding powerful performance with Core i7 CPU generation, 16Gb RAM</strong></h3>\r\n\r\n<p>MSI Crosshair 15 laptop is equipped with Intel Core i7-12700H processor. Accompanied by a cache of up to 24MB with a clock speed from basic 3.5 GHz to up to 4.7GHz when overclocked to help your laptop handle basic tasks as well as play games powerfully, smoothly, smoothly, without interruption.</p>\r\n\r\n<p><img alt=\"Laptop MSI Crosshair 15 B12UEZ-460VN | Hiệu năng mạnh mẽ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/6/20220406_aa737416-8405-4d95-bc43-0c312b631776.jpg\" /></p>\r\n\r\n<p>In addition, MSI also equips MSI Crosshair 15 B12UEZ Laptop with 16Gb DDR4 3200MHz RAM. Besides, there are 2 slots that support up to 64GB. With this design, your laptop will be able to process and store data quickly and smoothly. Helps you freely store data on your laptop.</p>\r\n\r\n<h3><strong>NVIDIA GeForce RTX 3060 graphics card, storage up to 1TB SSD</strong></h3>\r\n\r\n<p>MSI Crosshair 15 laptop is equipped with a modern NVIDIA GeForce RTX 3060 6GB GDDR6 graphics chip that stands out for the ability to display sharp, realistic images. Suitable for users who often have to work with graphics software, design for you to immerse yourself in colorful spaces.</p>\r\n\r\n<p><img alt=\"Laptop MSI Crosshair 15 B12UEZ-460VN | Đa dạng cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/6/20220406_79881b33-7054-402a-88d2-c5dcde5932f2.jpg\" /></p>\r\n\r\n<p>In addition to the NVIDIA GeForce RTX 3060 6GB GDDR6 / Intel Iris Xe Graphics graphics card, the MSI Crosshair 15 laptop offers up to 1TB of NVMe M.2 SSD. At the same time, it helps to optimize the operation of the machine, increase the start-up speed of the machine, operate the application to support users to work more efficiently.</p>\r\n\r\n<h3><strong>The common 3-cell battery is quite durable, the keyboard is equipped with convenient LED lights</strong></h3>\r\n\r\n<p>With the MSI Crosshair 15 laptop, it is equipped with a 3-cell 53Wh battery that can be used for a period of 2-3 hours depending on the nature of the job. The keyboard of this MSI laptop is a commonly used standard keyboard, the pleasant feeling of pressing keys brings high efficiency to users. In addition, it also supports LED lighting to highlight in low-light environments, minimizing errors when typing.</p>\r\n\r\n<p><img alt=\"Laptop MSI Crosshair 15 B12UEZ-460VN | Thời lượng pin ổn định\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/6/20220406_f5f85698-a71a-4716-9475-fa0e97cfc3e0.jpg\" /></p>\r\n\r\n<h3><strong>Using many popular connection ports, windows 11 Home operating system</strong></h3>\r\n\r\n<p>The above MSI gaming laptop with many ports on the device includes 1 USB 3.2 Type C port, 2 USB 3.2 ports, 1 USB 2.0 port and 1 1Gbps LAN port to help you easily connect to many other devices. There is also WiFi 802.11ax (Wifi 6) wireless connection, Bluetooth 5.2 transfers at smooth, fast speeds.</p>\r\n\r\n<p><img alt=\"Laptop MSI Crosshair 15 B12UEZ-460VN | Đa dạng cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/6/20220406_e9e8000d-1ed1-490b-a27b-67872244b71d.jpg\" /></p>\r\n\r\n<p>MSI Crosshair 15 laptop has been pre-installed with Windows 11 Home operating system equipped with modern features to make it more convenient and quick to use in work or gaming, bringing a fresh feeling that is not boring like the old operating system.</p>',2.300,'35.9 x 25.9 x 2.69 cm','yes','Win 11 Home',53,12,'2023-03-09 09:18:35','2023-03-10 13:23:54'),(38,63,'<h2>Lenovo ThinkBook 14 G4 + IAP 21CX001QVN is a laptop line with a high-end design and thin and light. This laptop model will be an ideal choice for office workers, schoolchildren - students. Besides, Lenovo ThinkBook 14 owns an Intel Core i5-12500H processor and 16GB of RAM, promising to bring stable and smooth power on all tasks.</h2>','<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_3627a501-9d4f-4dc0-a76c-5b254f48f68c.png\" /></p>\r\n\r\n<h3>Luxurious, high-end design with monolithic aluminum metal case</h3>\r\n\r\n<p>Lenovo ThinkBook 14 G4+ IAP 21CX001QVN laptop owns a luxurious, high-end appearance along with ultra-thin screen bezels, bringing neatness, sophistication and thinness and lightness like never before with dimensions of only&nbsp;<strong>31.2 x 22.4 x 1.59cm</strong>&nbsp;and a modest weight of&nbsp;<strong>1.4kg.</strong></p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Thiết kế sang trọng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_794d3891-9ee1-44e8-9685-7bf20e5526e0.png\" /></p>\r\n\r\n<p>Besides, Lenovo laptops have a case finished in solid aluminum metal coated in beautiful gray color. Not only increases durability but also provides a sturdy grip, contributing to the luxury of the computer. In addition, the hinge of this laptop is designed extremely firmly and meticulously, can be opened and folded up to 180 degrees to help you comfortably adjust the viewing angle, optimizing all viewing angles with your needs.</p>\r\n\r\n<h3>Stable configuration on Intel Core i5-12500H, Onboard graphics chip Intel Iris Xe Graphics</h3>\r\n\r\n<p>Lenovo ThinkBook 14 supports advanced&nbsp;<strong>5th generation Intel Core i12500-12H&nbsp;</strong>processors with&nbsp;<strong>12 cores</strong>,&nbsp;<strong>16 threads</strong>&nbsp;and a clock speed of up to&nbsp;<strong>4.5GHz</strong>&nbsp;support to help your computer run smoothly with office tasks, basic graphics or comfortable entertainment on movies, even play light games.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Hiệu năng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_230024ca-2dfb-4f19-9fdf-f4b2176a7d78.png\" /></p>\r\n\r\n<p>Lenovo ThinkBook 14 owns Onboard&nbsp;<strong>Intel Iris Xe Graphics&nbsp;</strong>chip capable of<strong>&nbsp;</strong>handling all graphics tasks quite well, supporting high image quality up to 8K plus 4K HDR to help you enjoy many unique,<strong>&nbsp;</strong>attractive and extremely sharp movies.</p>\r\n\r\n<h3>Thin 14-inch screen with 90Hz refresh rate</h3>\r\n\r\n<p>Lenovo laptops have a screen of just&nbsp;<strong>14 inches</strong>&nbsp;that gives you a comfortable view that serves well in work as well as study. The screen is designed with an&nbsp;<strong>IPS</strong>&nbsp;panel and an impressive resolution of&nbsp;<strong>2880 x 1800 pixels</strong>, giving you an immersive experience on every image detail displayed perfectly, the true colors almost coincide with reality.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Màn hình\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_18595810-7492-4fae-bce0-06c3576d2755.png\" /></p>\r\n\r\n<p>Besides, the screen has a refresh rate of&nbsp;<strong>90Hz</strong>&nbsp;that makes all movements smoother and clearer than ever, thereby limiting eye strain or soreness when you have to focus on observing for a long time. In addition, Lenovo laptops also support<strong>&nbsp;FHD Webcam</strong>&nbsp;with sharp image quality that gives you a lot of convenience on online calls at work as well as study.</p>\r\n\r\n<h3>16GB Onboard RAM, 512GB SSD storage</h3>\r\n\r\n<p>Lenovo laptop has a large RAM memory of up to<strong>&nbsp;16GB</strong>&nbsp;with 2 slots, LPDDR5 standard RAM has been improved in terms of transfer speed and power consumption compared to its predecessor,&nbsp;<strong>LPDDR4</strong>, and you need to note that this<strong>&nbsp;RAM&nbsp;</strong>stick is Onboard, so it cannot be removed to upgrade.</p>\r\n\r\n