 variety of ports with 1 USB&nbsp;<strong>Type C / DisplayPort / Power Delivery</strong>&nbsp;port, 2 USB 3.2 ports, 1&nbsp;<strong>USB 2.0</strong>&nbsp;port, 1&nbsp;<strong>micro SD&nbsp;</strong>card slot&nbsp;port to quickly transfer all data, 1&nbsp;<strong>Thunderbolt 4</strong>&nbsp;port connecting many devices such as mouse or keyboard,&nbsp;<strong>Audio combo</strong>&nbsp;port, 1<strong>&nbsp;HDMI</strong>&nbsp;port that outputs images in Full HD quality and<strong>&nbsp;1 GB / s LAN</strong>&nbsp;connects to the network at high speed.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_e6be7082-709b-4149-bfaf-ba0e10cbdc7b.png\" /></p>',1.400,'31.2 x 22.4 x 1.59','FHD','Windows 11',62,24,'2023-03-09 09:18:57','2023-03-10 13:22:40'),(39,64,'<h2>Lenovo ThinkBook 15 G2 ITL 20VE00UNVN is designed with a modern, high-end look and sturdy materials on the body. Besides, the machine has strong performance with 8GB RAM will give customers the best use experience.</h2>','<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_24be810a-7315-4490-b5fb-7a7be06a4d09.png\" /></p>\r\n\r\n<h3>Possessing a modern, new design and moderate size</h3>\r\n\r\n<p>Lenovo ThinkBook 15 is designed in a luxurious, modern direction so that when you look at it, you will feel the difference clearly. The device uses&nbsp;<strong>gray</strong>&nbsp;tones as the main color and&nbsp;<strong>ThinkBook</strong>&nbsp;letters printed on the back surface to help create a highlight for the machine, attracting the eyes of others.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Thiết kế hiện đại\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_67001ea9-ee5c-45b7-90bd-f3572f91cb1b.png\" /></p>\r\n\r\n<p>Besides, this 