ong>&nbsp;and can be upgraded to&nbsp;<strong>4.7GHz</strong>&nbsp;.&nbsp;<strong>24MB</strong>&nbsp;cache with&nbsp;<strong>14 cores</strong>&nbsp;,&nbsp;<strong>20 threads</strong>&nbsp;structure&nbsp;allows extremely smooth handling of heavy tasks, especially playing blockbuster game genres with high requirements on machine performance.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop Gigabyte Aorus 17 XE5-73VN534GH |  Amazing performance\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/9/20220409_9184366d-0083-4708-829e-d06a4543555c.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Gigabyte has equipped its computer with&nbsp;<strong>16GB</strong>&nbsp;DDR5 RAM for a bus that reaches&nbsp;<strong>4800MHz</strong>&nbsp;, providing larger storage capacity, faster response speed than&nbsp;<strong>DDR4</strong>&nbsp;Ram .&nbsp;Besides, the machine also supports&nbsp;<strong>2 ram slots</strong>&nbsp;for users to expand memory, perform multiple tasks simultaneously on the machine easily.&nbsp;</p>\r\n\r\n<h3><strong>NVIDIA GeForce RTX 3070Ti graphics chip, massive 1TB SSD hard drive&nbsp;</strong></h3>\r\n\r\n<p><strong>The manufacturer did not hesitate to equip its Gigabyte Aorus 17 XE5 laptop with an NVIDIA GeForce RTX 3070Ti 8GB GDDR6</strong>&nbsp;video card that&nbsp;provides the same display with sharp colors and high resolution.&nbsp;With this video card you can comfortably use graphics software, play games or watch HD movies smoothly.</p>\r\n\r\n<p><img alt=\"Laptop Gigabyte Aorus 17 XE5-73VN534GH |  Huge capacity hard drive\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/9/20220409_d89b29ce-e583-405d-b72c-c8734b167e7f.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>Standard M.2 NVMe SSD with a capacity of up to&nbsp;<strong>1TB</strong>&nbsp;(equivalent to 1024GB) helps this&nbsp;<strong>Gigabyte Aorus 17 XE5</strong>&nbsp;possess a pretty terrible storage capacity.&nbsp;Along with this huge storage space, SSD hard drive also allows users to achieve high bandwidth speed, get into the game immediately without having to wait any longer.&nbsp;</p>\r\n\r\n<h3><strong>The 99Wh battery lasts a long time, the RGB keyboard has a convenient numeric keypad</strong></h3>\r\n\r\n<p>The Gigabyte Aorus 17 XE5 laptop uses a built-in battery, with long battery life.&nbsp;Specifically, the device is powered by a&nbsp;<strong>4cell 99Wh</strong>&nbsp;battery, which is equivalent to a continuous use time of about 8 hours, but it only takes about 2-3 hours to fully charge the battery and continue to use it for your needs. without worrying about interruptions.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop Gigabyte Aorus 17 XE5-73VN534GH |  Battery lasts quite a while\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/9/20220409_e7d9806c-273d-4080-8f0d-e16e33181810.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>For more convenience in shooting, Gigabyte provides a Full Size keyboard for its Aorus 17 XE5.&nbsp;The number pad is equipped on the right corner of the keyboard to make typing faster.&nbsp;In addition, the machine also has an innovative RGB color backlight, creating eye-catching effects, allowing you to customize the color according to your preferences, especially suitable for gamers to use in their game space.</p>\r\n\r\n<h3><strong>Using Windows 11 Home SL operating system, integrating common connection ports.</strong></h3>\r\n\r\n<p>This Aorus 17 XE5 computer is pre-installed by Gigabyte with the new operating system on the market today Windows 11 Home SL, bringing a new interface, exciting experience to you.&nbsp;With this preparation, users will not need to spend more time installing or upgrading the operating system for their computers, saving costs and ensuring product safety.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop Gigabyte Aorus 17 XE5-73VN534GH |  Wide variety of common connection ports\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/4/9/20220409_29a6a3ac-ae08-4cd8-81ac-6948359b935a.jpg\" style=\"height:auto\" /></p>\r\n\r\n<p>To maximize connectivity with peripheral devices, the manufacturer has equipped the Gigabyte AORUS 17 with many common connections such as:&nbsp;<strong>1 HDMI port</strong>&nbsp;,&nbsp;<strong>2 USB 3.2 ports</strong>&nbsp;,&nbsp;<strong>1 Thunderbolt 4 port</strong>&nbsp;,&nbsp;<strong>1 LAN port 2500 Mbps</strong>&nbsp;.&nbsp;In addition, you can access data quickly and have the opportunity to experience an extremely smooth feeling when playing games with WiFi 802.11ax (Wifi 6) that the device brings.&nbsp;</p>',2.700,'39.8 x 25.4 x 2.7','FHD','Windows 11',70,36,'2023-03-20 10:19:13','2023-03-20 10:19:13'),(58,82,'<h2><strong>Acer Swift 3 SF314-512-741L</strong></h2>\r\n\r\n<h2><strong>A performance revolution for thin and light laptops&nbsp;&nbsp;</strong></h2>\r\n\r\n<p>Acer&nbsp;<strong>Swift 3 SF314-512-741L</strong> laptop is a new super product of the Acer family that has just been launched not long ago. It is one of the &nbsp;most sought after&nbsp;Acer laptops&nbsp;among&nbsp; office workers and students today thanks to its impressive performance and slim, luxurious appearance. Despite being a new face in &nbsp;the&nbsp;office laptop&nbsp;industry&nbsp; , <strong>Acer Swift 3 SF314-512-741L</strong> soon became the first choice of many people with its revolutionary 7th generation Intel Core i12 processor.</p>','<h2><strong>Elegant, modern and sophisticated design</strong></h2>\r\n\r\n<p><strong>Acer Swift 3 SF314-512-741L</strong> possesses an extremely elegant and luxurious appearance. The metal case frame is made from aluminum-magnesium, which provides 4 times more durability than conventional aluminum alloys. This frame is elegantly covered in Gold color, giving a sturdy feeling to the touch, and also very cool and happy to the hand.</p>\r\n\r\n<p>The compact design will be a big plus when with a light weight of only about 1.2kg, you can easily put <strong>Acer Swift 3 SF314-512-741L</strong> in a backpack or bag to take anywhere. The &quot;Acer&quot; logo instead of being in the center of the back cover has now been arranged on the top edge, creating a new, neat look and also more eye-catching.</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-11-2022/43681_laptop_acer_swift_3_sf314_512_741l_nx_k7jsv__3_.jpg\" /></p>\r\n\r\n<p>The screen border of the device is designed to be thin on the sides, but the top and bottom edges are relatively thick, but its advantage is to help users avoid external influences, limit damage when accidentally bumping the machine.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Outstanding performance from the latest Intel Gen 12 chip</strong></h2>\r\n\r\n<p><strong>Acer Swift 3 SF314-512-741L</strong>&nbsp;is&nbsp; equipped with Intel Core i7 1260P processor for a performance increase of 40% higher than the Intel Gen 11 generation. The Cinebench R23 instrument measurement score is significantly superior to its predecessor, only slightly inferior to the high-performance H series. The power from the Intel Gen 12 processor can smoothly handle basic office tasks such as Word, Excel, and PowerPoint. Intel Iris Xe Graphics integrated card supports designing and editing 2D images smoothly on Photoshop, Canva, Figma,... as well as surfing the web and playing online games stably.</p>\r\n\r\n<p>16GB RAM with LPDDR4X standard for a stable multitasking experience, meeting all needs when I edit videos and open a few more Chrome browser windows but the device still works smoothly, without lag.</p>\r\n\r\n<p>1TB NVMe PCIe SSD for super large storage space to store academic materials, essays or scientific research as well as necessary work.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Excellent visual experience on the 14-inch QHD display</strong></h2>\r\n\r\n<p><strong>Acer Swift 3 SF314-512-741L</strong> owns a 14-inch screen, QHD resolution (2560 x 1440) and a display ratio of 82.73% to bring sharp, realistic photo frames with bright colors, wider viewing angles. The combination of IPS panels and Acer ComfyView technology minimizes color change whether you look directly or sideways up to 178 degrees. You can completely experience great images when performing some simple tasks such as watching movies, surfing the web or studying.</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-11-2022/43681_laptop_acer_swift_3_sf314_512_741l_nx_k7jsv__2_.jpg\" /></p>\r\n\r\n<p>In addition, Acer ComfyView LED backlit technology is also integrated to help adjust the lighting better. Therefore, you will be less likely to experience soreness and eye strain when exposed to the laptop screen for too long. The <strong>Acer Swift 3 SF314-512-741L</strong>&nbsp;display&nbsp; eliminates motion blur and leaves only perfectly smooth picture quality.</p>\r\n\r\n<p>In particular, this laptop also owns Acer Color Intelligence and ExaColor technology to improve color contrast, making the display quality of the device extremely outstanding.</p>\r\n\r\n<p>The screen of Acer Swift 3 has parameters of 100% sRGB, 77% Adobe RGB and 78% DCI-P3, so you can completely use the machine for editing, basic or semi-professional image design on Adobe home software.</p>\r\n\r\n<h2><strong>Smooth keyboard &amp; responsive touchpad</strong></h2>\r\n\r\n<p>The keyboard of <strong>Acer Swift 3 SF314-512-741L</strong> has a stripped-down layout, spacious designed keys, relatively deep key travel and stable bounce, providing a comfortable, smooth text editing experience. Standard keyboard with built-in LED backlight, providing user comfort in all lighting conditions.</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-11-2022/43681_laptop_acer_swift_3_sf314_512_741l_nx_k7jsv__4_.jpg\" /></p>\r\n\r\n<p>The touchpad is well completed by Acer, the feeling of touch and swipe is very smooth and happy. However, the size is a bit small, so when hovering, it will not be possible to scroll through a web page.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Secure security</strong></h2>\r\n\r\n<p>When using a laptop, security is always a concern for users. Understanding this problem, <strong>Acer Swift 3 SF314-512-741L</strong> is equipped with fingerprint sensor technology. This feature helps users unlock the screen quickly and more securely thanks to the fingerprint sensor located right under the keyboard. It can be seen that Acer has done a great job in enforcing optimal security for users.</p>\r\n\r\n<p>In particular, this Acer Swift 3 also meets the Intel Evo background standard for a thin and light device that fully meets strict requirements such as fast boot speed, fast charging technology, modern connection standards,...</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Impressive battery life</strong></h2>\r\n\r\n<p><strong>Acer Swift 3 SF314-512-741L</strong> is equipped with a 4-cell 56Wh battery, which can maintain on-screen time up to 17 hours. This battery is quite popular in the market and is used on most Acer laptops. Fast charging support has now been updated on the Swift 3 SF314, with just 30 minutes of charging you can use the laptop within 4 hours.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Diversified, fast connection</strong></h2>\r\n\r\n<p>Wi-Fi 6E wireless connection standard and Full HD Webcam bring high transfer speed, ensuring the network connection as well as images are always stable and sharp when I make video calls, study or work online on Zoom, Google Meet, Ms Team,...</p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-11-2022/43681_laptop_acer_swift_3_sf314_512_741l_nx_k7jsv__7_.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://anphat.com.vn/media/lib/07-11-2022/43681_laptop_acer_swift_3_sf314_512_741l_nx_k7jsv__1_.jpg\" /></p>\r\n\r\n<p>Connectors such as USB 3.2, 3.5mm headphone jack, HDMI and Thunderbolt 4 port support data transfer to many different types of peripherals such as mice, keyboards, headphones ,... especially the HDMI port helps students easily output presentations to the projector during class sessions.</p>\r\n\r\n<p>The Thunderbolt 4 port allows you to transfer, display, and support high-speed fast charging, making transferring data from mobile devices has never been easier.</p>\r\n\r\n<p><strong><em>Acer Swift 3 SF314-512-741L</em></strong><em> promises to bring users a good experience, meeting all the needs of a student thanks to its modern appearance and high performance from Intel Gen 12 processor. </em></p>',1.200,'32.1 x 21.08 x 1.59','HD 1080p','Windows 11',56,16,'2023-03-20 11:21:27','2023-03-20 11:21:27');
